R["fx__eu__@mondennebel__76"]="{['TS']=1728748908,['Version']=1773,['Effects']={[1]={['X']=66758.001819,['Contrast']=1,['Color']=997132,['Roll']=0,['SizeX']=86.456456,['Yaw']=3.375467,['EffectType']=8503,['Alpha']=1,['Y']=5395,['Id']=1057,['Z']=76247.519128,['Pitch']=5.759587,['SizeZ']=130,['SizeY']=130,['MetaData']={['message']='Willkommen im diesjährigen Halloweenhaus von Ellysium, schön das du da bist.\\nBevor es losgehen kann, gibt es noch ein paar kleine Regeln, die es für ein gutes Spiel zu beachten gilt.\\n\\nZu Beginn schau ob es neben Deinem (1-2 Personen) Team weitere Personen im Haus gibt. (nachzuschauen im Basis Ui (Anwesenden x/24) oder unter Heimschau F5 ---> R (Gäste x/24) Falls ja, lass die Person ungest��rt spielen und komme zu einem späteren Zeitpunkt wieder.\\n\\nSollte außer Deinem Team niemand im Haus sein, aber ein Dwemerglas versperrt dir den Zugang, musst du den Hochelfischen- Altar (rechts hinter dir) benutzen, um das Spielerlebnis zu laden. \\n\\nSobald die Dwemerglasscheibe weg ist kannst du /ihr anfangen. Begebt euch dazu zur Picknickdecke (links) und beginnt mit dem Abenteuer. Der Eingangsbereich schließt sich automatisch, wenn der erste Schritt vom Abenteuer gestartet wird.\\n\\nWenn du/ihr abbrechen müßt, setzt bitte das Erlebnis zurück. Dafür sollte das Team über F5 --->H zum Eingangsbereich porten. Nun den Hochelfischen- Altar benutzen, 2 min warten (damit der reset sauber abschließt) und dann könnt ihr zu einem späteren Zeitpunkt zurückkehren und von vorn beginnen.\\n\\nHast du/ihr das Haus durchgespielt, lest die letzten Hinweise und setzt das Haus wie dort beschriebenzurück und wartet 2 min. Wir bitten euch an dieser Stelle das Haus zu verlassen ohne erneutes umherwandern, um zu verhindern das Mechaniken erneut aktiviert werden. Danke.\\n\\nAuf dem Weg könnt ihr Kürbissgruppen finden und zählen. Eine Gruppe besteht aus mindestens 2 Kübissen. \\nDas Ziel dieses Spieles ist es alle Etappen des Hauses zu meistern, am Ende einen Screenshot mit deinem/eurem Kürbisergebins im Discord zu posten.\\n\\nNun aber genug erzählt. Wir wünschen Euch viel Spaß.\\n\\nWendac und Elly',['title']='Buch der Regeln',},['Groups']=0,},},}"
