R["oh__@chalomar"]="{['eu']={[33]={['O']=19343,['D']='',['N']='Carneval parade',['C']=1.016000,},[5]={['O']=19171,['D']='A cosy place to play tales of tribute',['N']='Appartement de Sentinelle',['C']=1.500000,},[70]={['O']=19249,['D']='this forsaken temple is said to be cursed. But there are rumors that said that a dunmer has settled her lair there. Mind the pets to find her secret places.',['N']='Temple de Rimmen',['C']=1.002000,},[71]={['O']=19252,['D']='For those missing holidays, \"le Camping du lac\" offers all you can wish for fun ; sports, games, restaurants and comfortable already furnished tents and bungalows. All inclusive!',['N']='Prairie d\\'Elsweyr',['C']=1.022000,},[9]={['O']=19489,['D']='',['N']='Mathiisen GP',['C']=1.044000,},[42]={['O']=19213,['D']='',['N']='Auberge de Vivec',['C']=1.014000,},[11]={['O']=19268,['D']='just another aquarium, for a quiet rest between trials',['N']='L\\'aquarium psijique',['C']=1.012000,},[12]={['D']='Druidic cottage',['O']=19713,['N']='Collège druidique',['C']=1.020000,},[15]={['O']=19167,['D']='Orcs are settled in Grathwood',['N']='New-Orc Village',['C']=1.017000,},[48]={['O']=19448,['D']='\"\"\"Some books are more immersive than they first seem\"\" : fed up with that litteracy homework, you skip out by the window to play D&D with your friends. But as you come back, you feel something weird in your parents\\'house. time for the proud 16 old you are to investigate. \\nNB : sounds matter a lot to the atmosphere and please close the doors behind you for the next visit.\"\\nNote : you may need to rolldodge forward to reach the end of the story\\n',['N']='Salle d\\'Épervine',['C']=1.002000,},[81]={['O']=19134,['D']='',['N']='Skyrim Horror Park',['C']=1.023000,},[44]={['O']=19263,['D']='',['N']='Les havres gris',['C']=1.047000,},[26]={['D']='',['O']=20007,['N']='New Moon Casino',['C']=1.040000,},[23]={['O']=19134,['D']='',['N']='Auberge du lion d\\'or',['C']=1.013000,},[88]={['O']=19509,['D']='built for \"ESO meets Lovecraft \"contest, this is story of my first encounter with Lovecraft universe in the eighties',['N']='Demeure du pont de Leyawiin',['C']=1.002000,},[25]={['O']=19215,['D']='A small altmer sculptor atelier',['N']='Maison baandari',['C']=1.045000,},[58]={['O']=19228,['D']='',['N']='Auberge d\\'Alinor',['C']=1.500000,},[60]={['O']=19237,['D']='Got something rare to sell ? Looking for something very special ? Need to enter Summerset secretly ? Welcome to \"Port Nulle part\"',['N']='Port Nulle part',['C']=1.018000,},[28]={['O']=19134,['D']='',['N']='Au Dragon Rouge',['C']=1.050000,},[49]={['O']=19409,['D']='',['N']='Chez Laurel',['C']=1.026000,},[47]={['O']=19415,['D']='too many wipes ? your favorite hero may need a break  Offer him a stay at the Grand Palace hotel : Cosy chambers, nice food and a training room to refill.',['N']='Grand Palace Hôtel',['C']=1.017000,},[31]={['D']='',['O']=20004,['N']='Concert room',['C']=1.050000,},},['TS']=1728644814,['Key']='oh__@chalomar',['Version']=1773,}"
