R["oh__@beesweet2u"]="{['na']={[59]={['O']=19645,['D']='A She-Shed. It\\'s an artist\\'s retreat where she can paint, read, write letters, or just watch the butterflies in the small garden and munch on a sweetroll. It\\'s placed on the terrace of my Alinor Crest Townhouse. The house is empty except for a few \"doors\" and the room you walk thru to get to the terrace. Hope you all can visit on a sunny day.',['N']='Alinor House',['C']=1.025000,},[9]={['D']='An eccentric botanist\\'s home with an eclectic collection of banners and tapestries. Stroll thru the gardens, enjoy the waterfalls, and see the banners and tapestries collected from her travels throughout Tamriel. Fully stocked kitchen & working lab. Staff love her but wish she wouldn\\'t leave her teacups all over the house.',['O']=20007,['N']='Botanist Banner Home',['C']=1.021000,},[98]={['D']='Take a walk in the park to relax and renew your spirit. Explore the island with rest points along the way to enjoy the ocean view. Don\\'t miss the lighthouse and fisherman huts. May it bring you some peace.',['O']=19988,['N']='Fogbreak Park',['C']=1.021000,},[43]={['O']=19472,['D']='Upon seeing the exterior, you are sure the place is abandoned. However, certain rocks popping up make you wonder what awaits inside.',['N']='Hlaalu Home',['C']=1.043000,},[36]={['O']=19507,['D']='A place where Isobel, Bastian, and Caska plan their next grand adventure while Ember serves drinks at the swim up pool bar. Enjoy the fountains and sea life in the tidal pool. And hunt for the treasure trove that\\'s hidden nearby.\\t',['N']='Tidal Pool & More',['C']=1.018000,},[70]={['O']=19486,['D']='Halls of Colossus: Various monuments plus a a couple of places to relax by the water.\\nMoongrave Fane: A shrine to Khunzar\\'ri. Statues honoring heros of Elsweyr. Also, a little cafe.\\nLion\\'s Cradle: This floating garden has been impacted by an epic dragon fight which crumbled the skyborne ground.',['N']='Rimmen Temple',['C']=1.026000,},[94]={['D']='Welcome to a temple honoring the Divine known as Khenarthi by the Khajiit, as Kynareth by the Imperial Pantheon, as Kyne by the Nord, and as Tava by the Redguard. Also featuring the Daedric Prince of Dusk and Dawn, Azurah, and the Divine, Arkay.',['O']=19782,['N']='Khenarthi Temple',['C']=1.026000,},[71]={['O']=19779,['D']='A former palace and its grounds donated to the Intellectual Society for the Study of Rituals & Magical Arts. (Expanded 2/25/24',['N']='Elsweyr Meadow',['C']=1.020000,},},['Version']=1773,['TS']=1728620368,['Key']='oh__@beesweet2u',}"
