R["oh__@h01yhandgrenade"]="{['na']={[90]={['N']='GUARZILLA!',['D']='The Ayleids tried to warn the proud Telvanni\\nThe Telvanni Tried to warn us, of proud House Hexos\\nNow we, in our final hours, must try to warn you:\\nThough its power may be tempting, you cannot hope to defend against the horror it will unleash.\\nDO NOT TURN ON THE MUSIC BOX!',['C']=1.019000,['O']=19973,},[92]={['N']='Bargrave Resort &Spa',['O']=19957,['C']=1.028000,['D']='Welcome to Bargrave, an oasis resort for the worlds-weary traveler, conveniently located in a plane that practically never gets invaded by Daedra!\\n\\nGet some writs done in the workshop, or enjoy yourself in the bar or one of our numerous lounge areas*! Forget to say your prayers? We\\'ve got you covered with shrines to all the Daedric Princes that really matter. \\n\\n*some areas not safe for mortals',},[101]={['N']='Not A Cult',['O']=19926,['C']=1.023000,['D']='Thank you for choosing Not A Cult Crematory Services! We\\'re not a cult!\\n\\nYes, it\\'s true that the former owners were running this place as a Daedric cult, but we\\'ve decided to lean into it and we\\'re happy to announce the premises have been free of humanoid sacrifices for 6 months!\\n\\nRest assured your departed loved ones will NOT have their souls siphoned into Apocrypha. We don\\'t do that anymore! :)',},[70]={['N']='Rimmin\\' Temple',['O']=19770,['C']=1.021000,['D']='Moongrave Fane: Hanging Gardens\\nLion\\'s Cradle: Couch Fort\\nHalls of Colossus: Hedge Maze\\n\\nFollow the glowing peach blossoms to the party house! Watch out for slaughterfish!',},[47]={['N']='Fort Vulcan',['D']='What are the denizens of Bargrave to do when our humble resort comes under attack? Retreat to our mountain stronghold, of course!\\n\\nIntroducing Bargrave II: Eclectic Boogaloo! Whether you prefer the timeless magic of the Altmer or the brutal efficiency of the Bretons, patrons can enjoy lushly landscaped grounds (stolen directly from Tamriel), rest easy in one of two impenetrable castles, or delve into the depths of a floating mountain!\\n\\n*tours of all Bargrave properties available upon request*',['C']=1.017000,['O']=19958,},},['Key']='oh__@h01yhandgrenade',['Version']=1773,['TS']=1728592954,}"
