R["oh__@lilarna"]="{['Key']='oh__@lilarna',['TS']=1727039117,['Version']=1773,['na']={[16]={['D']='Title: Grand Warlord Dortene\\'s crib\\r\\n\\nStory: You really thought Grand Warlord Dortene lived full time in a tent? Come on, that bed is for naps only. When the evening comes, she walks up behind the gates of Southern High Rock with Captain Durida and they put down their shields for the night.',['N']='GrandWarlord Dortene',['O']=19611,['C']=1.500000,},[34]={['D']='You\\'ve made it through another night. As you step into this shelter, both hope and fear tear you apart. You scavenge through, and don\\'t find much. Disappointment floods in. But wait, what\\'s under that carpet? And, was that solar panels out there?!\\n\\n[ Inside the shelter, a carpet hides a passage that leads downwards. ]',['N']='The Shelter',['O']=19836,['C']=1.500000,},[35]={['D']=' Venture into the Vault of Wonders! After encountering the Djinn, let him whisk you away with his chaotic magic through his 4 elemental realms. Choose under which element the Djinn will bless you and pick which item in the build will become the catalyst for your new spells.\\n\\r\\nSpoiler: Some even say that standing in the far end of the pool of water and looking through the water-lilies grants a special extra power that affects your sight!',['N']='The Vault of Wonders',['O']=19602,['C']=1.500000,},[4]={['D']='Title:  \"Ennyn Durin Aran Moria: pedo mellon a minno.\"\\r\\n\\nStory: As she entered the ruins, the rocks closed off behind her. What kind of magic or riddle could trigger that switch? Was there even a passage to be found? She\\'s sleeping with her secret now. ',['N']='Ruins',['O']=19611,['C']=1.500000,},[102]={['D']='In the neon fallout,\\r\\nCode writhes, AI\\'s gone rogue,\\r\\nWe are ephemeral in the face of ten thousand rems.',['N']='10 000 rems',['O']=19775,['C']=1.500000,},[22]={['D']='Title: Haiku Season\\n\\nGreen leaves in water,\\nMemories drift through the mind—\\nIdeas turn to ink.',['N']='Haiku Season',['O']=19619,['C']=1.500000,},[71]={['D']='Title: Rainbow DNA\\r\\n\\nStory:  What brings us together also makes us all unique.',['N']='Rainbow DNA',['O']=19611,['C']=1.500000,},[3]={['D']='\"The Furry Flask Inn\\r\"\\nWelcome to our unique and charming vampiric bar, that specializes in offering the finest varieties of blood for connoisseurs like yourself. The most coveted of our drinks is this month\\'s special cocktail: \"Spicy Khajiit\"!',['N']='The Furry Flask Inn',['O']=19774,['C']=1.500000,},[10]={['D']='Title:  The Jungle Book\\r\\n\\r\\nAfter meeting Tabaqui in the cave, find your way out into the open. Meet Raksha and Father-Wolf but beware of Nag! ',['N']='Forests of the Night',['O']=19842,['C']=1.500000,},[58]={['D']='Title: The Torn Veil\\r\\n\\nStory: Jane Eyre, the governess at Thornfield Hall, falls in love with Mr Rochester. As she prepares for her wedding, she looks at the pearl-coloured dress and the vapoury veil before shutting the wardrobe. \"I will leave you by yourself, white dream\". As she wakes up in the night, a threatening woman tears the veil in two parts and flings it on the floor before leaving the bedroom.\\r\\nA novel by  Charlotte Brontë, 1847.',['N']='The Torn Veil',['O']=19611,['C']=1.500000,},[27]={['D']='Burning moonlight, red fire;\\r\\nSummoned forth from human desire;\\r\\nNow the Lady of the Hunt prowls;\\r\\nIn the wilderness she pries and growls.\\r\\n\\r\\nBetter toured with music off, sound effects on.',['N']='Ritual of the Hunt',['O']=19652,['C']=1.500000,},[28]={['D']='Come, come closer.',['N']='Come, come closer.',['O']=19611,['C']=1.500000,},[13]={['D']='Her Eyes are a Blue Million Miles...',['N']='A Blue Million Miles',['O']=19888,['C']=1.500000,},[42]={['D']='A memorial for Dreadfather, the late @Fantom2k.\\nFeel free to turn the candles on or off as you please.',['N']='Dreadfather Memorial',['O']=19598,['C']=1.029000,},[95]={['D']='Title: Painting of Geek, Summer\\r\\nStory: Is it a Razer mouse, or a Corsair one?',['C']=1.500000,['O']=19988,['N']='Geek Lair in Summer',},},['eu']={[49]={['D']='Title: Faith Matters\\nThere are 2 iterations of this build. Which one will be set up when you visit?!\\nStory: This secluded church is maintained by a priest who does his best to keep the faith alive. His offerings have been useless, for now, but maybe he has found a way...',['N']='Faith Matters',['O']=19624,['C']=1.500000,},[5]={['D']='Step into The Obsidian, a bar where dark, gleaming walls and dim lights set the stage for an unforgettable time. Enjoy our wide array of drinks, skooma, and dice games.',['N']='The Obsidian',['O']=19870,['C']=1.500000,},[70]={['D']='Our lives are but specks of dust falling through the fingers of time. Like sands of the hourglass, so are the days of our lives. - Socrates\\r\\n\\r\\nVisit: To enjoy best, visit portals as soon as they appear when you explore:\\r\\n(Lion\\'s C, Moongrave F, then the Centre of the main hall, finally Halls of C)\\r\\n\\r\\nSpoiler: to find out about the story, continue reading: Explore the Corridor of Time in this Psijic facility to study the rise and fall of the Elsweyr Empire at 4 different moments in time.',['N']='The Course of Empire',['O']=19495,['C']=1.500000,},[7]={['D']='(...) Come away, O human child! To the waters and the wild, With a faery, hand in hand, For the world\\'s more full of weeping than you can understand. (...) \\r\\n\\r-The Stolen Child, by William Butler Yeats, 1889\\n\\r\\nDirections: jump up through the window',['N']='Taken by the Seelie',['O']=19652,['C']=1.500000,},[71]={['D']='Botanical Theme Park.',['C']=1.500000,['O']=19918,['N']='Botanical theme park',},[105]={['D']='Welcome to this memorial house, built in loving memory of Iras, also known as @iras84 or Irene. Feel free to take a moment to gather your thoughts and memories in this peaceful shrine.',['N']='Memorial for Iras',['O']=19825,['C']=1.029000,},[58]={['D']='The Stuff that Dreams are made of.',['N']='StuffDreamsAreMadeOf',['O']=19918,['C']=1.500000,},[27]={['D']='On the 12th of December 2023, Twitch streamers started a raid train, called Infinite Archlive! To celebrate this fun event, Lilarna and Maya created a 3D version of the logo! Lo and behold, the raid train arrives! And feel free to take a selfie at the photobooth ;)',['N']='InfiniteArcliveTrain',['O']=19813,['C']=1.500000,},[44]={['D']='What binds together all those who live in this shelter ?\\r\\n\\r\\nSpoiler will follow : below here is \"my\" version of the backstory, if you want to read it before or after visiting.\\r\\nThis sanctuary welcomes women who saved themselves. Here they get to be patched up, heal and think it through. Some live a quiet life here. Others travel the world to find other women like them, survivors or fallen, to offer peace in some way or another. And a few have taken arms to retaliate and are taking names. \\r',['N']='The Lucky Ones',['O']=19245,['C']=1.007000,},[38]={['D']='Winter, at the Overlook Hotel. All work and no play makes Jack a dull boy. Luckily, there is always a party going on in the Golden Room. Here\\'s Johnny! Hi, Lloyd. A little slow tonight, isn\\'t it? Come play with us Danny. Forever... and ever...  and ever.\\n\\n\\nFor your own safety, keep your camera very, very close to you. At all times. Or even visit in first person! It\\'s just... safer.\\nAnd don\\'t forget to walk. Just imagine, if you trip over. Also, the music is better turned off.',['N']='Overlook Hotel',['O']=19787,['C']=1.500000,},[89]={['D']='Arcane Class Academy\\r\\n\\r\\nAfter today\\'s Daedric Summoning class, you\\'re not so sure the Sorcerer class is for you. No time to worry—gotta sprint to your next class for the final exam!',['N']='Arcane Class Academy',['O']=19870,['C']=1.500000,},[31]={['D']='Anglidor\\'s tiny apartment reeks of wine. He set dinner for two tonight but his guest was not seeking earthly pleasures.',['N']='The Final Act',['O']=19195,['C']=1.040000,},},}"
