R["oh__@charlio50"]="{['Key']='oh__@charlio50',['na']={[2]={['D']='Welcome to my little reading room! Grab a book, have a seat, and relax, while your fish crackles over an open flame pit. The Nix-ad is friendly... ',['N']='Daggerfall Inn',['O']=19458,['C']=1.051000,},[3]={['D']='Welcome to my efficient little room in Ebonheart!\\nRelax by the fire, enjoy a snack and a cup of your fave beverage. \\nEnjoy your visit & tell your friends about us... <3',['N']='Ebonheart Inn',['O']=19603,['C']=1.041000,},[4]={['D']='Welcome to a relaxing place to just rest for awhile... Enjoy your stay!',['N']='Skywatch Apartment',['O']=19448,['C']=1.051000,},[5]={['D']='Welcome to my spa in Senchal, a place to sit and relax while being pampered and entertained...\\n\\nEnjoy your visit!\\n',['N']='Sentinel Apartment',['O']=19470,['C']=1.014000,},[6]={['D']='Welcome to my one-room apartment in the fair city of Mournhold! Feel free to sell your excess baggage, or have Giladil break down your un-needed stuff! Rest, relax, and enjoy your stay!',['N']='Mournhold Apartment',['O']=19456,['C']=1.051000,},[7]={['D']='Welcome to my Aldmeri home! ',['N']='Black Vine House',['O']=19442,['C']=1.049000,},[8]={['D']='Welcome! Glad you stopped by for a visit. Relax by the fireplace, enjoy a cup of tea and sweetrolls, then take in a dreamy sleep upstairs...\\nEnjoy your stay <3',['N']='Marbruk Manor',['O']=19777,['C']=1.041000,},[9]={['D']='Welcome! to my beautiful Mathiisen estate. Fell free to wander the grounds, sit and relax by the fountain outback, or just rest in one of the many beds available.\\nEnjoy your stay & tell your friends about us!',['N']='Mathiisen House',['O']=19597,['C']=1.051000,},[10]={['D']='Welcome to my little humble mud home! Relax, enjoy the atmosphere and warmth...',['N']='Dhalmora House',['O']=19461,['C']=1.047000,},[11]={['D']='Welcome to my magnificent mud hut in Stormhold! Enjoy the many oddities about, then relax on the bed in the inside! Stay as long as you like - we\\'ll keep the fires burning...',['N']='Stormhold House',['O']=19456,['C']=1.019000,},[13]={['D']='Welcome to my snug little home in Grahtwood!\\nRelax by the fire, catch some Zzzzs \\nEnjoy your visit',['N']='Elden Root House',['O']=19462,['C']=1.020000,},[14]={['D']='Welcome to my Boldertree Refuge! Wander through the magical garden, full of lush, blooming trees and plants! Wander indoors, sit and relax in the first room, then on to the second room for contemplation, or read a book.\\nEnjoy your visit <3\\n',['N']='Longhaven House',['O']=19467,['C']=1.020000,},[15]={['D']='Welcome to my beautiful, hidden garden paradise!\\nRelax, enjoy the fresh air and get a walk in around the park! Lots of surprises!\\nEnjoy your visit, and be sure to invite your friends in to see this fantasy garden.',['N']='Cormount House',['O']=19585,['C']=1.021000,},[16]={['D']='Welcome to my cozy little cabin, in town! Relax, take a nap, have a snack, and enjoy yourself...',['N']='House of Yrgunh',['O']=19452,['C']=1.051000,},[17]={['D']='Welcome! make yourself at home and enjoy the warm atmosphere, inside and out back!',['N']='Fell\\'s Run House',['O']=19444,['C']=1.051000,},[18]={['D']='A wip...',['N']='Wayrest House',['O']=18931,['C']=1.009000,},[20]={['D']='Welcome to my Velothi home! A little of everything to make your visit more enjoyable...rest, relax, and enjoy exploring - just don\\'t cut the cheese... ;-)\\n',['N']='Mianique\\'s House',['O']=19476,['C']=1.051000,},[23]={['D']='Welcome to my humble little temple to pause and reflect, relax and meditate...\\nEnjoy your visit!',['N']='Rawl\\'kha House',['O']=19455,['C']=1.037000,},[24]={['D']='Welcome! Just moved in 01/01/24, still a WIP; in the meantime, feel free to wander the yard, inside to see empty rooms, for now...heh\\nRelax and enjoy your visit!',['N']='Dune House',['O']=19724,['C']=1.047000,},[25]={['D']='Welcome to my jungle! Rest in the shade, or in the house - both give you comfort!\\nEnjoy your stay!\\n<3',['N']='Karl\\'s Baandari Home',['O']=19875,['C']=1.047000,},[26]={['D']='Welcome to my gate house! Warm up by the fire, enjoy a beverage, and rest your weary bones! (the \\'hottie\\' on the bed upstairs is just that...)\\nEnjoy your stay!',['N']='Holtz Gate House',['O']=19461,['C']=1.051000,},[28]={['D']='Welcome! Just a small country cottage, still being added to/adjustments made...\\nThank you for visiting!',['N']='Nimalten House',['O']=19581,['C']=1.047000,},[29]={['D']='Welcome! to my cozy home in the city of Windhelm.\\nWarm yourself by the fire, share a toast at the bar, enjoy a feast at the table, take a nap upstairs, and just have a nice rest & recoup!',['N']='Windhelm House',['O']=19824,['C']=1.051000,},[30]={['D']='Welcome to my manor! relax and enjoy the gardens, and everything in between!',['N']='Karl\\'s Riften Manor',['O']=19451,['C']=1.051000,},[32]={['D']='Welcome to my Mournoth Keep, a w.i.p.; make yourself at home and enjoy your visit!\\n',['N']='Halcyon House',['O']=19476,['C']=1.051000,},[96]={['D']='Welcome to my manor in beautiful Gonfalon Bay! Lots of goodies to check out! Enjoy your visit!',['N']='Gonfalon Bay Manor',['O']=19457,['C']=1.051000,},[34]={['D']='Welcome to my home in the desert! Come in to a cool environment to relax and maybe catch a quick nap. Enjoy your stay! Oh, don\\'t forget the little desert garden in the front yard! ',['N']='Hallin\\'s Stand House',['O']=19459,['C']=1.051000,},[35]={['D']='Welcome to my home in the Alik\\'r Desert! Enjoy your visit!',['N']='Sentinel House',['O']=19442,['C']=1.051000,},[36]={['D']='Welcome to my beach-side resort! Kick off your shoes, and enjoy a walk along the beach! Then come in and cool off in the wide, expansive rooms...rest, relax, and enjoy your visit.\\n',['N']='Port Hunding House',['O']=19489,['C']=1.018000,},[70]={['D']='Welcome to my Hall of many wonders! Feel free to wander the three wings, but be wary of the steep drop-offs - no safety rails, fences, etc. to get in the way ;-) Enjoy your visit!',['N']='Rimmen Temple',['O']=19502,['C']=1.020000,},[103]={['D']='Welcome to my oasis in the desert! Just watch out for the hole...',['N']='Alik\\'r Oasis',['O']=19868,['C']=1.018000,},[104]={['D']='A mycologist/arcanist\\'s coastal home! Welcome! Enjoy the views and comforts of coastal living...enjoy your stay! And tell your friends about us. <3!',['N']='Arcanist\\'s Hideaway',['O']=19864,['C']=1.018000,},[42]={['D']='Welcome to my penthouse! No windows to peer from, but plenty to see and contemplate while relaxing on the comfy bench! Lie back and enjoy the ceiling fixture and tile work! Tell your friends to stop by <3',['N']='Vivec City Inn',['O']=19602,['C']=1.045000,},[75]={['D']='Welcome to my seaside \\'shanty\\'! Feel free to roam the grounds, all around, from top to bottom!\\nEnjoy your visit...',['N']='Wrothgar Village',['O']=19452,['C']=1.018000,},[44]={['D']='Welcome to my Ald Velothi home! Enjoy the seaside breezes and the tropical garden outside, then go inside and relax, catch a nap, use the facilities downstairs, as well as upstairs!',['N']='Redoran Home',['O']=19492,['C']=1.018000,},[109]={['D']='Welcome to my room in Skingrad! \\nSurprised to see a Chimera Statue staring you in the eye? It\\'s harmless as a butterfly but can scare the m-mh out of the un-wary! ;)\\nEnjoy your visit!',['C']=1.051000,['O']=19983,['N']='Mianique\\'s Hideaway',},[47]={['D']='Welcome to my surreal space in time! Wander the grounds in amusement and amazement at the bazaar and the strange...benches provided for your relaxation. A place to tell the grandkiddos about ;)\\nTell your friends about us, and visit anytime <3',['N']='Coldharbour Island',['O']=19618,['C']=1.026000,},[80]={['D']='Welcome! to my chill retreat in Skyrim! \\n...w.i.p.\\n\\nEnjoy your visit!',['N']='Skyrim Glacier Lake',['O']=19548,['C']=1.020000,},[49]={['D']='A def place to visit for that Halloween vibe!',['N']='Gr8 Pumpkin Charlio',['O']=19977,['C']=1.002000,},[63]={['D']='Welcome to my year-round snowy little world! Saturalia anyone? Relax, slow down, and enjoy your visit!\\n',['N']='New Life Snow Globe',['O']=19481,['C']=1.022000,},[71]={['D']='Welcome! Enjoy the many wonders of the Kajjit style in my wonder world of tropical beauty! Relax and have fun wandering the grounds...',['N']='My Thai Meadow',['O']=19447,['C']=1.018000,},[100]={['D']='Welcome! to my comfy little room in Necrom - close to all the amenities the city has to offer! Relax, release your stress by the fire, then catch a nap on our sturdy beds...\\nEnjoy your stay, and tell your friends about us! <3!',['N']='Necrom Inn',['O']=19600,['C']=1.045000,},[87]={['D']='Welcome to my \\'cozy\\' little room at the Leyawiin Inn...\\'Do you know how long I\\'ve waited for you?\\'',['N']='Leyawiin Inn',['O']=19474,['C']=1.038000,},[88]={['D']='Multi purpose split home over the water, convenient place to rest and recoup...\\nEnjoy your visit!',['N']='Leyawiin Bridge Home',['O']=19845,['C']=1.051000,},[81]={['D']='Welcome to my Gallery! Enjoy roaming the grounds and be sure to visit the inside displays - a little something for everyone...',['N']='Hjaalmarch Gallery',['O']=19476,['C']=1.051000,},[90]={['D']='Welcome! Enjoy the many wonders of land born in lava! P.S. the themed areas may have been part of this world at one point...',['N']='Deadlands Plot',['O']=19448,['C']=1.020000,},[59]={['D']='Enjoy the many wonders of Tamriel, displayed in such a beautiful, spacious manor - from the entrance to the terrace. Enjoy your visit!',['N']='Reggie\\'s Town House',['O']=19439,['C']=1.051000,},[92]={['D']='Welcome to my Fargrave Manor! Wander the place, relax, and take in the \\'odd\\' atmosphere that fascinates the curious mind!\\nEnjoy your visit!',['N']='Fargrave Manor',['O']=19504,['C']=1.018000,},[61]={['D']='Lore inspired for your enjoyment! Have fun checking everywhere - more to come...',['N']='Werewolf Den',['O']=19792,['C']=1.020000,},[62]={['D']='Welcome! Feast your eyes on the many hidden objects scattered all over...\\nEnjoy!',['N']='charlio\\'s manor',['O']=19441,['C']=1.018000,},[95]={['D']='Just a room for rest and relaxation, with aquarium! Relax and enjoy!',['N']='Gonfalon Bay Inn',['O']=19444,['C']=1.046000,},},['eu']={[103]={['D']='Welcome to the Grand Bazzaar! \\nWander wherer you will, just don\\'t get near the edge of the hole...',['N']='Alik\\'r Oasis',['O']=19846,['C']=1.018000,},},['TS']=1726547928,['Version']=1773,}"
