R["oh__@katchlight"]="{['TS']=1724769711,['eu']={[71]={['D']='By a twist of fate, you\\'ve been drafted into the army stationed at the great Gatehouse of Ruin, \\r\\npreparing for the arrival of Prince Ithilia. \\r\\n\\nSome believe the statue at Ruin is a long forgotten immortal, frozen in time and that she will rise again\\r\\none day to fight against forces threatening Nirn.\\r\\n\\nMuster your courage for the battle to come... you will need it.',['C']=1.033000,['O']=19858,['N']='TheGatehouseOfRuin',},[35]={['D']='The Dark Library\\n\\nPart 2 of the Tiny Stores Series',['C']=1.048000,['O']=19031,['N']='Sentinel House',},[14]={['D']='Grandma, is that you?\\n\\nMy take on Little Red Riding Hood\\'s visit to Grandmas cottage.',['C']=1.044000,['O']=19921,['N']='Grandmas Cottage',},[23]={['D']='The Apothecary\\n\\nPart 1 of the Tiny Stores series',['C']=1.041000,['O']=19031,['N']='The Apothecary',},[91]={['D']='The Sorcerers Sanctuary, a place of peace and meditation for study of the arcane and astronomical. ',['C']=1.020000,['O']=18931,['N']='Sorcerers Sanctuary',},[39]={['D']='Agent X,\\n\\nDetails for your next mission:\\n\\nPRIORITY: High\\nTARGET: Dr. J.L Bastion\\nDIRECTIVE: Secure and extract\\nBRIEF: Entry points to the city via roads are barricaded, attempt access via storm sewers.\\n\\nNo reports of remaining hostiles, caution is still advised.\\n\\nRegards, K.',['C']=1.023000,['O']=19921,['N']='LOCATION:GROUND ZERO',},[40]={['D']='Well, well, well adventurer, it appears that you have come across a rather secret place... a place where the greatest force of nature is manipulated and controlled, bent and wielded with magic. YOU have stumbled upon the Chronomancers home.',['C']=1.020000,['O']=19858,['N']='The Chronomancer',},[59]={['D']='The Tiny Toy Store!\\n\\nPart 3 of the Tiny Stores series ',['C']=1.041000,['O']=19031,['N']='Tiny Toy Store',},[43]={['D']='If you\\'re serious about getting fit and learning to fight then LvL UP GYM is the place for you!\\n\\nNone of that fancy gym stuff, just good ol\\' fashioned hard work and sweat. Don\\'t let our humble location fool you; we\\'ve trained some of the best fighters in the last 50 years, join us and be part of the legacy!\\n\\nP.S Never mind the homeless bum, he\\'s mostly harmless <3',['C']=1.046000,['O']=19921,['N']='LvL UP GYM',},[107]={['D']='The Victorian\\n\\nVictorian inspired mansion on a scenic waterfall estate.',['C']=1.021000,['O']=19962,['N']='The Victorian',},[56]={['D']='A bit creepy, a bit mysterious, a bit beautiful. The Master Crafters\\' shelter hidden in these little-visited ancient ruins is the perfect quiet place to do her work.',['C']=1.017000,['O']=19428,['N']='Kvatch Sanctuary',},[61]={['D']='Rest your weary, road travelled body at The Crooked-Hat!\\n\\n5 star services away from the prying eyes of the world.\\n\\nWalk-ins and bookings available',['C']=1.020000,['O']=19945,['N']='The Crooked Hat Inn',},[94]={['D']='March 13th 1928\\n\\nThings have been unsettled in Kingsport of late. A slew of disturbing events have hit our usually sleepy city: all since a group of strangers arrived at our gates a fotnight past.\\n\\nI have not been down in those dreaded tunnels since I was a boy. With grandfather. \\n\\nHe lectured about vigilence, Old Gods and sleeping evils as we stood in the fetid water.',['C']=1.019000,['O']=19921,['N']='Our Abandoned Past',},[47]={['D']='This tiny creature nobly took over the work of his master after his untimely death. From the lonely Forgotten Archives, The Apprenctice painstakingly cares for the balance of magicka in Nirn. \\n',['C']=1.019000,['O']=19139,['N']='The Apprentice',},},['Key']='oh__@katchlight',['Version']=1773,}"
