R["oh__@tinyfangs"]="{['Key']='oh__@tinyfangs',['Version']=1773,['TS']=1724410527,['eu']={[64]={['D']='Roleplaywise, most of my characters are Aos Si, an ancient mythological race from Ireland. They are a group of scholars, here to explore their ancestral roots. This home serves as their base, where they collect artifacts and conduct experiments predominately involving plants.',['C']=1.007000,['O']=19287,['N']='Point of Arrival',},[49]={['O']=18521,['N']='Meadow\\'s Homestead',},[66]={['D']='Another maze that was closed to the public for years and only available for guild events. Find the lava and you find the maze :P Get to where the blue light shines. Heals help, health regen food helps, being a Dark Elf helps.\\nThe duelling arena also has some additions. 9ground target skills do not work on the upper levels0',['C']=1.003000,['O']=19956,['N']='Trial By Fire (maze)',},[3]={['O']=18600,['N']='The Forest Chapel',},[63]={['O']=18555,['N']='Sheo\\'s Pool Party',},[23]={['D']='The war had cost her everything. A young Imperial soldier, tortured, burned... A small Aldmeri Dominion unit realised she was still breathing, and so she was rescued. Among her rescuers an old Khajiit, whose kind friendship gave her the strength to continue on. When the war took him too, she found he had left her his house. A note in his belongings read: My little no claw, as you lost your home, now you shall have mine. Eventually peace will come and all will heal, including your broken heart.',['C']=1.051000,['O']=19958,['N']='A Friend\\'s Love FX',},[43]={['D']='The ivy really took to that fertilising spell... Fortunately it did not permeate the walls, leaving the insides still liveable, but the budding botanic mage, owning the property, has since decided to cut down on her wild experimentations.',['C']=1.021000,['O']=19432,['N']='Ivy gone mad',},[41]={['O']=18487,['N']='Leannán\\'s Lament',},[74]={['D']='Opening this maze after years where it was only available for guild events. Get to the top level with the skyshard. Enjoy :P <3\\nEach level has a hint.\\n1. Find what lies hidden\\n2. Find the path (and the signal fire is not the finish)\\n3. Again, find what lies hidden\\n4. Seek what you have come to fear',['C']=1.003000,['O']=19956,['N']='The Splash (maze)',},[75]={['O']=18525,['N']='The Hound\\'s Abode',},[73]={['D']='A small tucked away hotel with wedding venue, where guests can enjoy good food and drink, while pondering the unusual name of the hotel - until they spot the reason.',['C']=1.007000,['O']=19369,['N']='The Peeing Khajiit',},[18]={['D']='Just someone\\'s home. FX not needed.',['C']=1.051000,['O']=19956,['N']='Wayrest House',},[71]={['O']=18602,['N']='Homage to Tolkien',},[47]={['O']=18505,['N']='Ohal Ruined Estate',},},}"
