n my thralls a good lifetime to build this place, a nice reclusive retreat, just what I had wished for - until you came along. It isn\\'t that I fear facing you in open battle, but you hounds never fight fair. Have you ever thought about what life free of the leash could be like? I doubt it. You all follow Danu blindly. She might be the oldest of us and the only survivor of the original council, but that does not mean we have to live our eternal life chained to her laws!\\n\\nHave the place, you earned it. How you found my trail I do not know, I spent much effort on erasing my tracks, heck, I even entered a bargain with Molag to change the very essence of my being, yet here we are.\\n\\nWhat is my crime? That I fathered a few bastard children in this realm? That I did not stick to my original assignments? Forget it, I am not going back to have Danu sit in judgment over me. Yes you found me once, but I shall make sure your nose will run bloody trying to sniff me out again. It is such a shame. You are by far the most talented of your shapeshifting pack, I actually really liked you once, we could have had fun, you and I, but your stupid loyalty to Danu makes you my enemy now, and next time we meet I shan\\'t run but kill you, with Molag\\'s help, I shall find a way to end your eternal existence.\\n\\n - Ghost, no longer a slave to the Tuath Dé and your idiotic dusty laws\\n\\n\\nPS.: Don\\'t have the pups defecate all over the beds or chew the table legs. I might be back eventually and would prefer to not find my home completely wrecked by your stupid pack!',},['Y']=19062,['SizeY']=48,['EffectType']=8501,['Pitch']=4.670501,['Alpha']=1,['SizeX']=46.456456,['Id']=1419,['SizeZ']=48,['Color']=102439,['Z']=97878,['Roll']=0,['Groups']=0,['Contrast']=1,['X']=63081,},[36]={['Yaw']=3.602360,['EffectType']=407,['SizeY']=592,['Y']=19475,['Pitch']=6.272713,['Alpha']=0.640000,['SizeX']=1103,['Id']=1420,['Z']=98023,['Roll']=0,['SizeZ']=592,['Color']=63599,['Groups']=0,['Contrast']=1.580000,['X']=64402,},[37]={['Yaw']=5.138249,['EffectType']=407,['SizeY']=592,['Y']=19479,['Pitch']=6.272713,['Alpha']=0.820000,['SizeX']=304,['Id']=1421,['Z']=97645,['Roll']=0,['SizeZ']=592,['Color']=354699,['Groups']=0,['Contrast']=1.380000,['X']=64824,},[38]={['Yaw']=5.187119,['EffectType']=407,['SizeY']=592,['Y']=19479,['Pitch']=6.272713,['Alpha']=0.820000,['SizeX']=291,['Id']=1422,['Z']=98140,['Roll']=0,['SizeZ']=592,['Color']=354699,['Groups']=0,['Contrast']=1.380000,['X']=63842,},[39]={['Yaw']=0.443314,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=19576,['SizeY']=182.250000,['EffectType']=5162,['Pitch']=0,['Alpha']=1,['SizeX']=570,['Id']=1423,['SizeZ']=182.250000,['Color']=437,['Z']=97129,['Roll']=0,['Groups']=0,['Contrast']=0.420000,['X']=62391,},[40]={['Yaw']=2.143264,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=19588,['SizeY']=169.250000,['EffectType']=5162,['Pitch']=0,['Alpha']=1,['SizeX']=313,['Id']=1424,['SizeZ']=169.250000,['Color']=937,['Z']=94863,['Roll']=0,['Groups']=0,['Contrast']=0.500000,['X']=63980,},[41]={['Yaw']=3.591888,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=19576,['SizeY']=178,['EffectType']=5151,['Pitch']=0,['Alpha']=1,['SizeX']=408,['Id']=1425,['SizeZ']=178,['Color']=333333,['Z']=97084,['Roll']=0,['Groups']=0,['Contrast']=0.620000,['X']=62443,},[42]={['Yaw']=3.577925,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=19575,['SizeY']=179,['EffectType']=5151,['Pitch']=0,['Alpha']=1,['SizeX']=408,['Id']=1426,['SizeZ']=179,['Color']=333333,['Z']=97176,['Roll']=0,['Groups']=0,['Contrast']=1.140000,['X']=62249,},[43]={['Yaw']=2.356194,['MetaData']={['title']='The Hound\\'s Report',['message']='Update on the last developments.\\n\\nAs I suspected, the target is still present in Tamriel, and the latest lead proved to finally bear success. He has been hiding in the border region between Rivenspire and Wrothgar, however, as I closed in on him, he vanished. I assume he must have a spy embedded in the village I arrived at, more than likely another naive girl, succumbed to his charms. Some things will never change about him, but he left me a note full of whiny ramblings and petty insults. In it he mentions that he has allied himself with Molag to change his essence. I would say this means we are now dealing with a vampire, more than likely of true blood. This would certainly explain why it has been such a challenging hunt, yet even as a true blood he appears to fear us.\\n\\nI have taken possession of this property. He claims in his note to have had it built for himself, and I have not found traces of any ordinary mortals. It lies very secluded, only reachable via boat, and the pups love it, plenty of space. I will leave them to guard, just in case he should try return, although I doubt it, not yet, he knows I can see, hear and smell through the pups senses.\\n\\nSpeaking of smell, we have greater advantage now. His vampiric change made it hard to track him while we searched for his old essence. Now I have his new scent, and shall pursue the prey accordingly.\\n\\nLeannán chose to explore Western Skyrim, has she not? Please ask her to keep eyes and ears open. From what I have heard, it appears a breeding ground for those bloodsuckers (and please tell Aurnia this is not meant as an insult to her). I shall keep my nose on the ground too. He won\\'t escape us forever.\\n\\n- Ana, loyal Hound to our beloved Lady Danu',},['Y']=19063,['SizeY']=30,['EffectType']=8503,['Pitch']=4.799655,['Alpha']=1,['SizeX']=26.456456,['Id']=1427,['SizeZ']=30,['Color']=102439,['Z']=97822,['Roll']=0,['Groups']=0,['Contrast']=1,['X']=62970,},[44]={['Yaw']=4.974188,['EffectType']=608,['SizeY']=900,['Y']=11951,['Pitch']=0.523599,['Alpha']=1,['SizeX']=700,['Id']=1428,['Z']=95132,['Roll']=0,['SizeZ']=900,['Color']=999999,['Groups']=0,['Contrast']=0.750000,['X']=76984,},[45]={['Yaw']=3.054326,['EffectType']=609,['SizeY']=700,['Y']=12031,['Pitch']=0.610865,['Alpha']=1,['SizeX']=900,['Id']=1429,['Z']=97173,['Roll']=0,['SizeZ']=700,['Color']=999999,['Groups']=0,['Contrast']=0.880000,['X']=76174,},[46]={['Yaw']=5.585054,['MetaData']={['title']='Ana\\'s Journal',['message']='I have written my report, and for now shall grant myself some time to breathe. I have been hunting this traitor day and night for so long, now I need to focus on training the next litter. I lost out on spending quality time with the little ones already, so this place is an unexpected gift to all of the pack. I have set the lures, so they learn to ignore the smell of blood. They are my next set of eyes and ears and noses, and they must not give in to distraction and temptation. The method is embarrassingly simple, truly, for a people as advanced as we are, but it has been tried and tested over and over, and sometimes the simplest solution is still the best.\\n\\nAt first I was disappointed that Ghost got away, but after some contemplation, I am actually looking forth to chasing him some more. Now that he has revealed his secret to me, I shall know better what to look for, yet there is this nagging question as to why did he reveal himself. Maybe he thought I\\'d figure it anyway, and I probably would have, but I can not help wonder if he is planning to set his own trap. He sure has found himself a powerful enough ally, so I certainly will have to watch my steps, but what is a hunt without some challenge? That my prey is smart and dangerous makes it considerably more thrilling.\\n\\nBut for now we shall enjoy the comforts of our new home. I am glad I have finally been able to deliver some results, and shall see if there will be any new orders, although I doubt there will be a change. He has to be caught and brought to justice. He can\\'t be left to run wild in this realm, considering all the knowledge he carries. He is a risk to us all, and must be eliminated.\\n\\n(((a letter from the fugitive as well as Ana\\'s report can be found on the upstairs table)))',},['Y']=18301,['SizeY']=50,['EffectType']=8502,['Pitch']=4.719370,['Alpha']=1,['SizeX']=39.456456,['Id']=1430,['SizeZ']=50,['Color']=83869,['Z']=96411,['Roll']=0,['Groups']=0,['Contrast']=0.840000,['X']=64480,},[47]={['Yaw']=4.712389,['EffectType']=462,['SizeY']=61,['Y']=18231,['Pitch']=0,['Alpha']=1,['SizeX']=59,['Id']=1431,['Z']=97818,['Roll']=0,['SizeZ']=61,['Color']=998969,['Groups']=0,['Contrast']=0.360000,['X']=63348,},[48]={['Yaw']=5.284857,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=19582,['SizeY']=157.500000,['EffectType']=5158,['Pitch']=0,['Alpha']=1,['SizeX']=284.750000,['Id']=1433,['SizeZ']=157.500000,['Color']=333532,['Z']=94879,['Roll']=0,['Groups']=0,['Contrast']=0.430000,['X']=63968,},[49]={['Yaw']=2.076942,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=19661,['SizeY']=3309,['EffectType']=5119,['Pitch']=1.570971,['Alpha']=1,['SizeX']=273,['Id']=1435,['SizeZ']=3309,['Color']=999999,['Z']=97310,['Roll']=0,['Groups']=0,['Contrast']=0.580000,['X']=63469,},[50]={['Yaw']=0.544543,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=19659,['SizeY']=2211,['EffectType']=5119,['Pitch']=1.567306,['Alpha']=1,['SizeX']=273,['Id']=1436,['SizeZ']=2211,['Color']=999999,['Z']=95600,['Roll']=0,['Groups']=0,['Contrast']=0.660000,['X']=64765,},[51]={['Yaw']=5.204572,['EffectType']=168,['SizeY']=187,['Y']=19392,['Pitch']=0,['Alpha']=1,['SizeX']=380,['Id']=1438,['Z']=96078,['Roll']=0,['SizeZ']=187,['Color']=818181,['Groups']=0,['Contrast']=0.770000,['X']=61776,},[52]={['Yaw']=2.052507,['EffectType']=166,['SizeY']=146,['Y']=19306,['Pitch']=0.003491,['Alpha']=1,['SizeX']=180,['Id']=1439,['Z']=97329,['Roll']=0,['SizeZ']=146,['Color']=999999,['Groups']=0,['Contrast']=0.940000,['X']=60844,},[53]={['Yaw']=5.410521,['EffectType']=632,['SizeY']=1700,['Y']=18110,['Pitch']=4.712564,['Alpha']=1,['SizeX']=900,['Id']=1440,['Z']=94498,['Roll']=0,['Size