ae, formerly known as Ohal\\'s Fortress.\\n\\nOnce a huge fortress towered upon this big platform, but it has since been reduced to nothing but dust. Ohal was a mighty daedric general who originally served Mehrunes Dagon, along with his clan, yet after Mehrunes was driven back from Nirn, Ohal changed allegiance and joined Molag Bal.\\n\\nThe Prince of Brutality welcomed the powerful, smart and ambitious Ohal along with his fierce clan, alas events, not all clear in every detail, led to the fall of his new mighty general, and neither his name nor that of his clan are even whispered now in Coldharbour.\\n\\nIt can be assume the fact Ohal and his clan found a living child within Coldharbour, a girl with unusual magical abilities, probably led to Ohal\\'s ruin.\\n\\nAt the age of 8, Alyael\\'s cultist parents decided to sacrifice their only daughter to Molag, however, the child managed to free itself from the binding spell, just as the blade began to slice into her chest. Dazed and panicked, the girl stumbled into a daedric portal, next finding herself in a cold and inhospitable place. 4 years Alyael survived undetected in Coldharbour, stealing flesh atronach parts and drinking Coldharbour water. She grew feral, and by the end she was hard to tell apart from the usual Soulshriven. Had chance not led to her capture, she probably would not have been able to resist the adverse effects of the poisoned waters for much longer.\\n\\nOhal realized the raw magical potential of the girl, as well as being unable to deny the human child a certain amount of respect for its incredible will. The girl, despite being undernourished, had fought his warriors teeth and claws before they finally had managed to knock her unconscious.',},['Y']=36881,['SizeY']=42,['EffectType']=8502,['Pitch']=4.733333,['Alpha']=1,['SizeX']=30.456456,['Id']=1300,['SizeZ']=42,['Color']=993809,['Z']=84880,['Roll']=0,['Groups']=0,['Contrast']=0.840000,['X']=83355,},[27]={['Yaw']=3.337070,['MetaData']={['title']='Ohal\\'s Ruined Estate - Part 2',['message']='Alyael was caged in the dungeon below this platform, with Ohal personally tending to her, and despite all the trauma, the child still harboured enough humanity to long for connection and eventually entrusted herself to Ohal\\'s care and guidance. Ironically it proved to be a daedra to show her the first kindness she had ever experienced, and she came to blindly love her daedric Master.\\n\\nYet drinking Coldharbour Water for years had done irreversible damage and it became clear Alyael would not be able to escape the fate of a mind shriven. It was then that Ohal decided to turn to his former Prince, Mehrunes, for aid. Mehrunes agreed to corrupt Alyael with his own essence, not unlike Molag creating true blood vampires. It was an experiment, which just as easily could have gone wrong, but Alyael once again proved able to survive what few could. The procedure turned her into a new creation, part human, part daedric, and.. something different.\\n\\nWhen Alyael returned from the Deadlands, Ohal and his clan were gone. The fortress had been destroyed and Molag had erected a statue of himself in its place. What exactly had come to pass, Alyael never found out, but Molag had clearly not been aware of the caves surrounding the platform, or not bothered with them, as Alyael found them untouched. She took possession of the platform and raised a protective barrier around it, now in full possession of her magical abilities - and more.\\n\\n Even without knowing the details, it has been clear that Ohal and his clan were cast into The Darkness, and Alyael has sworn revenge. She has created her own portal to Tamriel,  and with the help of illusion magic she will appear as just a normal young woman while wandering Tamriel, seeking to widen her knowledge, while biting her time and plotting...',},['Y']=36881,['SizeY']=42,['EffectType']=8502,['Pitch']=4.733333,['Alpha']=1,['SizeX']=30.456456,['Id']=1302,['SizeZ']=42,['Color']=32399,['Z']=84899,['Roll']=0,['Groups']=0,['Contrast']=0.840000,['X']=83292,},[28]={['Yaw']=5.284857,['MetaData']={['title']='Alyael\\'s Journal',['message']='I shall start a new journal, for I believe to finally have found what I have been seeking. Long enough it has taken me, but I guess when dealing with daedric princes, one must be willing to extend endless patience. One can not plot the fall of one of theirs like one would go about planning a dinner party in Tamriel.\\n\\nYet I do believe to have found the answer, and it appears so simple now, I can not believe I missed this for as long as I have, alas my excitement is dampened by the fact there is no guarantee my enthusiasm will be joined by the one I will have to involve, even if it appears logical that we should share.. let us say a certain interest in this subject...\\n\\nIf my eyes would still be human, I would say they\\'d by now be bleeding from all the abuse I have subjected them to, reading and reading and reading even more, but the torture has born fruit. I know now who I must seek as my ally. Mehrunes says he can not confront Molag in open warfare, even though that is what he is best at. A pity, I would have enjoyed such a show.. yet instead I shall turn to the one who wishes to see all souls returned to the void, which certainly can not happen if Molag enslaves all souls.\\n\\nSithis.. dread-father.. you MUST aid me...\\n\\nI believe now only you can help me take my revenge, but again I have to practise patience. I have to get this right, so you will not dismiss me.\\n\\nThe ritual.. I have to use the ritual, yet also need to alter it, send all the thoughts I have to you, so you can see my reasoning, for while our motivations surely differ, our goals clearly align.\\n\\n..and I know in time you will return, Master, you are not gone, and if my plan works, I am certain Mehrunes will reward us both...',},['Y']=34533,['SizeY']=49,['EffectType']=8502,['Pitch']=4.712564,['Alpha']=1,['SizeX']=44.456456,['Id']=1303,['SizeZ']=49,['Color']=102439,['Z']=102292,['Roll']=0,['Groups']=0,['Contrast']=1,['X']=81283,},},['Version']='15.4.7',['World']='eu',['TS']=1600254897,['HouseId']=47,},[4]={['Effects']={[1]={['Yaw']=1.315978,['EffectType']=80,['SizeY']=78,['Y']=10303,['Pitch']=0,['Alpha']=1,['SizeX']=76,['Id']=1058,['Z']=41864,['Roll']=0,['SizeZ']=78,['Color']=999999,['Groups']=0,['Contrast']=0.600000,['X']=54424,},[2]={['Yaw']=4.492477,['EffectType']=175,['SizeY']=167,['Y']=10326,['Pitch']=0,['Alpha']=1,['SizeX']=359,['Id']=1059,['Z']=42204,['Roll']=0,['SizeZ']=167,['Color']=999999,['Groups']=0,['Contrast']=1,['X']=55595,},[3]={['Yaw']=2.988004,['EffectType']=577,['SizeY']=36,['Y']=10487,['Pitch']=0.062832,['Alpha']=1,['SizeX']=36,['Id']=1060,['Z']=43624,['Roll']=0,['SizeZ']=36,['Color']=102709,['Groups']=0,['Contrast']=1,['X']=54578,},[4]={['Yaw']=2.974041,['EffectType']=4547,['SizeY']=160,['Y']=14072,['Pitch']=0,['Alpha']=0.750000,['SizeX']=100,['Id']=1220,['Z']=42456,['Roll']=0,['SizeZ']=160,['Color']=928399,['Groups']=0,['Contrast']=1,['X']=53672,},[5]={['Yaw']=4.499459,['EffectType']=726,['SizeY']=167,['Y']=10755,['Pitch']=0,['Alpha']=1,['SizeX']=231,['Id']=1222,['Z']=42667,['Roll']=0,['SizeZ']=167,['Color']=999999,['Groups']=0,['Contrast']=1,['X']=55381,},[6]={['Yaw']=1.570796,['EffectType']=462,['SizeY']=121,['Y']=10633,['Pitch']=0,['Alpha']=1,['SizeX']=121,['Id']=1223,['Z']=42396,['Roll']=0,['SizeZ']=121,['Color']=999026,['Groups']=0,['Contrast']=1,['X']=54117,},[7]={['Yaw']=1.350885,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Y']=10805,['SizeY']=627,['EffectType']=5128,['Pitch']=0,['Alpha']=1,['SizeX']=440,['Id']=1224,['SizeZ']=627,['Color']=0,['Z']=42342,['Roll']=0,['Groups']=0,['Contrast']=1,['X']=54021,},[8]={['Yaw']=1.396263,['EffectType']=30,['SizeY']=440,['Y']=10768,['Pitch']=1.483530,['Alpha']=1,['SizeX']=400,['Id']=1225,['Z']=42376,['Roll']=0,['SizeZ']=440,['Color']=10699,['Groups']=0,['Contrast']=2.880000,['X']=54026,},},['Version']='15.3.4',['World']='eu',['TS']=1597453441,['HouseId']=7,},[5]={['Effects']={[1]={['Yaw']=4.712389,['EffectType']=63,['SizeY']=1,['Y']=10185,['Pitch']=0,['Alpha']=1,['SizeX']=4000,['Id']=1370,['Z']=48846,['Roll']=0,['SizeZ']=4000,['Color']=999536,['Groups']=0,['Contrast']=0.460000,['X']=65050,},[2]={['Yaw']=2.167699,['EffectType']=6009,['SizeY']=70,['Y']=10771,['Pitch']=0,['Alpha']=1,['SizeX']=76,['Id']=1371,['Z']=50226,['Roll']=0,['SizeZ']=70,['Color']=395555,['Groups']=0,['Contrast']=0.540000,['X']=62170,},[3]={['Yaw']=0.083776,['EffectType']=878,['SizeY']=200,['Y']=10409,['Pitch']=1.570971,['Alpha']=1,['SizeX']=460,['Id']=1373,['Z']=49849,['Roll']=0,['SizeZ']=200,['Color']=0,['Groups']=0,['Contrast']=0.250000,['X']=64034,},[4]={['Yaw']=0,['MetaData']={['title']='Meadow\\'s Diary',['message']='It has been a year now since mother passed, and I miss her every day. I am certain few would believe a hag could make a good mother, but I could not have wished for a more loving upbringing. I arrived a wee baby, floating in a basket upon the waves, and she raised me with all the warmth and care my real mother obviously must not have felt for me.\\n\\nWhile mother led the coven, the hags around here were kinder. The new coven leader changed everything and even threatened mother and I. It hurt mother greatly to see her sisters turn on her, but at least we had each other.\\n\\nNow mother is gone, and I feel a longing to see more of the world. Mother\\'s old friend has moved into the hut, and he has agreed to look after everything. Not sure where I wish to go, maybe explore my wood elf roots, but I highly doubt they will welcome me. I was not raised by their rules and shall never find myself able to abide by them. Mother tried teach me some of it, but that\\'s just not the same.\\n\\nVery scary to think of the journey ahead, when the furthest I have ever been is the market in Daggerfall, but waking every morning missing mother so much is more than I can bear. I have to leave, I just have to, even though no matter where fate will lead me, I do know that this place will forever remain my most beloved home. Mother\\'s grave behind the hut makes certain of that, and all the wonderful childhood memories which will forever bind me to every pebble and every blade of grass...',},['Y']=10588,['SizeY']=35,['EffectType']=8501,['Pitch']=4.747296,['Alpha']=1,['SizeX']=26.456456,['Id']=1374,['SizeZ']=35,['Color']=824,['Z']=48682,['Roll']=0,['Groups']=0,['Contrast']=0.820000,['X']=61882,},[5]={['Yaw']=3.965388,['EffectType']=240,['SizeY']=201,['Y']=10685,['Pitch']=0,['Alpha']=1,['SizeX']=154,['Id']=1375,['Z']=50386,['Roll']=0,['SizeZ']=201,['Color']=667799,['Groups']=0,['Contrast']=0.880000,['X']=63152,},},['Version']='15.4.7',['World']='eu',['TS']=1600268594,['HouseId']=49,},[6]={['Effects']={[1]={['Yaw']=5.913176,['EffectType']=984,['SizeY']=3600,['Y']=32676,['Pitch']=0,['Alpha']=1,['SizeX']=8400,['Id']=1486,['SizeZ']=3600,['Roll']=0,['Z']=118529,['Color']=70559,['Groups']=0,['Contrast']=1.250000,['X']=120492,},[2]={['Yaw']=0.706858,['EffectType']=5085,['SizeY']=2100,['Y']=33998,['Pitch']=0,['Alpha']=1,['SizeX']=2866.666667,['Id']=1493,['SizeZ']=2100,['Roll']=0,['Z']=123133,['Color']=999999,['Groups']=0,['Contrast']=3.250000,['X']=129628,},[3]={['Yaw']=3.848451,['EffectType']=5085,['SizeY']=2100,['Y']=33998,['Pitch']=0,['Alpha']=1,['SizeX']=2866.666667,['Id']=1494,['SizeZ']=2100,['Roll']=0,['Z']=123060,['Color']=999999,['Groups']=0,['Contrast']=3.160000,['X']=129609,},[4]={['Yaw']=5.644395,['EffectType']=632,['SizeY']=500,['Y']=37735,['Pitch']=0,['Alpha']=1,['SizeX']=540,['Id']=1495,['SizeZ']=500,['Roll']=0,['Z']=118520,['Color']=999999,['Groups']=0,['Contrast']=1,['X']=125284,},[5]={['Yaw']=0.516617,['MetaData']={['title']='Last Will',['message']='By the Nine, I didn\\'t think I\\'d end like this. I mean we all have to end, but killed trying to jump down from height to land in a puddle? I guess I shall leave my home and all that\\'s in it to my sister. Not that I like her much, but I like everyone else even less.\\n\\nWill Trailbeard\\n\\n*\\n\\nI can make it, I know I can and I shall, so why write a bloody will? Let the greedy horkers fight over it, just in case I can\\'t make it, but I will! I think...\\n\\nPete\\n\\n*\\n\\nI don\\'t want to jump! Curse all daedra and their princes! My poor William, what shall he do without me? He was never good at anything, the useless fool, he needs me to look after all the gold we got when his mother died. It is my gold now! I guess William would have it for himself, but what if I refuse to jump?\\n\\nSheogorath says he will push me, in fact he is saying he will push me right n..\\n\\n(unsigned)',},['Y']=37788,['SizeY']=30,['EffectType']=8503,['Pitch']=4.712564,['Alpha']=1,['SizeX']=26.456456,['Id']=1496,['SizeZ']=30,['Color']=102439,['Z']=118892,['Roll']=0,['Groups']=0,['Contrast']=1,['X']=124629,},[6]={['Yaw']=0.242601,['MetaData']={['title']='A Welcome Note from Sheogorath',['message']='\\nJump little birdie, jump! Or is it fly? Maybe it is both?\\n\\nLeap like you have never leaped before, with open arms, then bounce!\\n\\nBounce as if your life depends on it, although by that time you more than likely will have lost it, but nevermind that, what\\'s a little blood on the carpet?\\n\\nOr in the pool?\\n\\nYes in the pool! That was it! Leap and fly and bounce for Uncle Sheo, but not on Sweet Winter\\'s bed, her bed is not the pool, oh no it isn\\'t! And if she catches you, she shall turn you into a frog, for that could help with the leaping, yet not..\\n\\nthe flying!\\n\\n\\n((Feel free to use Sheo\\'s Bloody Pool Party for events. First to clear all jumps without dying - wins! <3))\\n',},['Y']=33620,['SizeY']=56,['EffectType']=8503,['Pitch']=4.799655,['Alpha']=1,['SizeX']=33.456456,['Id']=1497,['SizeZ']=56,['Color']=997920,['Z']=124494,['Roll']=0,['Groups']=0,['Contrast']=3.940000,['X']=131180,},[7]={['Yaw']=1.560324,['EffectType']=280,['SizeY']=167,['Y']=24124,['Pitch']=0,[