R["oh__@aetherial_heavenn"]="{['TS']=1723793152,['na']={[81]={['D']='Five Spirit Wardens left Pariah Abbey to follow rumours of a rift to the Moonshadow Realm located under the mysteriously glowing night skies of the north. After months, they arrived at an abandoned schoolhouse next to the rupture and remade it into a simple Chapel to Azura that reminded them of home. Over the years they tended the shard of the Moonshadow, and created a Shrine and Garden Temple to their Daedric Prince. Four of them continue to greet worshipers, and lead simple lives of reverence',['C']=1.026000,['N']='Azura\\'s Abbey ',['O']=19311,},[18]={['D']='Tricks n Trinkets- Elegantly Creepy.\\r\\nLyranth has opened a business with Tythis as business advisor.\\r\\nTrinkets for tourists are on street level, darker tricks for the unwary downstairs, a discreet meeting room & Tythis\\' quarters upstairs & large items are in the courtyard.\\n(contains spider, webs and some gore)',['C']=1.500000,['N']='Tricks n Trinkets',['O']=19836,},[37]={['D']='Giverny is Claude Monet\\'s Home and Garden, now a museum. See the waterlily pool and garden designed by the artist, the extended long house and his original outdoor studio. Inside is the famous yellow dining room and blue kitchen, Monet and Alice\\'s simple bedrooms upstairs, siting rooms for te large family,  and their curio and art collection.',['C']=1.030000,['N']='Giverny',['O']=19703,},[41]={['D']='Scenes from Wonderland:\\nEat me/drink me~ White Rabbit`&The Missing Gloves~The Caucus Race~The Duchess, Pepper& Pigbaby~ The Mad Hatter\\'s Tea Party~Painting of Roses~ The Croquet Game~The Hookah Smoking Caterpillar~ (at last!) The Cheshire Cat',['C']=1.040000,['N']='Wonderland Scenes',['O']=19901,},[90]={['D']='Rides! Sideshow! Food! Ghost Train!\\nThe Fargrave Fairground is where the Daedra love to play.\\n(relisted because it disappeared. wip)',['C']=1.500000,['N']='Fargrave  Fairground',['O']=19702,},[59]={['D']='\"Love Cats\"  featuring wedding reception area, music room, honeymoon suite, and outdoor ceremonial marrriage area and shrines. And cats.',['C']=1.022000,['N']='LoveCats HeartsDay',['O']=19759,},[46]={['D']='(prev open. recently finished and made primary.)\\nPeralda has made a tree change and has moved to a self sufficient estate. Market garden, boutique winery, olive and nut groves, chooks and secret bowers are presided over by Dibella. Peralda has a suite upstairs, the Estate Managers live downstairs. Repairs are made on the premises and excess goods traded locally.',['C']=1.021000,['N']='Caisteal Nan Caillic',['O']=19318,},[62]={['D']='An exhibition builld using in game drops, achievements, antiquities, and NPC vendor ittems only. (No luxury, no crown, no crafted!) Made to show players the posssibilites of decorating without having to use expensive materials, crown items, or luxury items that may not be available for a year!',['C']=1.011000,['N']='Achievement Showcase',['O']=19889,},[15]={['D']='Sylvan Scenes\\nA series of interconnected landscape scenes showcasing indigenous plants and creatures of Tamriel. The deeper you explore the more fantastic the features and creatures. I hope to evoke anew the sense of wonder and magic we experienced when we first entered this beautiful world. Wander through the garden rooms, walk among the pools, crystal caves and enchanted forests, and watch the wildlife, in this serene setting. (ambient sound on please.) made fr That Magical Feeling Competition',['C']=1.500000,['N']='Sylvan Scenes',['O']=19711,},},['Version']=1773,['Key']='oh__@aetherial_heavenn',}"
