R["oh__@tazmyr"]="{['na']={[64]={['D']='Need a vacation? Magic holds an ancient lake at bay where Xanmeer ruins are transformed into resort and spa.  Welcome!',['N']='Tazmire Resort',['C']=1.012000,['O']=18891,},[98]={['D']='Welcome to TazLights Resort.\\nWhere the Slaughterfish are fresh, accomodations comfy, and the setting serene and relaxing. \\nSwimming is available, but appropriate armor may be needed if swimming in remote parts of the resort. Enjoy your vacation! ',['C']=1.018000,['N']='TazLights Resort',['O']=19925,},[69]={['D']='Remember Kalgrontiid? The bad-ass dragon with a serious attitude and delusions of god-hood? Well, we\\'ve been stealing dragon eggs from his clutch and serving them up at Elsweyr\\'s finest new  restaurant, \"Dragons\\' Knot Inn\".  Sit on the terrace while Kaalgrontiid himself, pissed as hell, blasts our magical shield as we laugh at him and eat dragon eggs in the Plane of Jode.  Walk through our open kitchen and watch as we prepare Dragon Eggs dishes jsut for you. Reservations suggested.',['C']=1.024000,['N']='Dragon\\'s Knot Inn',['O']=19623,},[86]={['D']='Need a break? Then the Spa and Nightclub at the Gold Coast Retreat is just the ticket! Relax, or party and dance all night to the tunes spun by none other than Jakarn himself. Rooftop pools offer amazing views while the lower-level lava-heated spa melts tired and sore muscles into bliss. All are welcome! ',['N']='Gold Coast Retreat',['C']=1.014000,['O']=19389,},[72]={['D']='Researching the Daedric Arts? Looking for a well-equipped laboratory for, well, researching? Then the Vile Menagerie is for you! Even has a bedroom for those long sessions waiting for lightning to strike. Did Stibbons just discover ... Sweetrolls?\\nWelcome!',['N']='The Vile Menagerie',['C']=1.038000,['O']=19249,},[41]={['D']='Resort Taz has 2 suites, a Brewpub, a Meadery with tasting room, observatory, and lots to explore.',['N']='The Taz Cave Resort',['C']=1.031000,['O']=18892,},[91]={['D']='Chateau Ste Tazriel is a winery and tasting room. It features beautiful grounds with an elevated pool for <skinny?> dipping, amazing views, and a 3rd-floor privatge suite for overnight guests. Got Wine? Welcome!',['N']='Chateau Ste Tazriel',['C']=1.021000,['O']=19108,},[44]={['D']='Sweet-Cheeks Bakery is open!\\nSweetrolls! And Hearty Breakfasts are offered in this country bakery and eatery. All hungry travelers are welcome.',['N']='Sweet-Cheeks Bakery',['C']=1.013000,['O']=19046,},[46]={['D']='Where a Tamriel Tinkerer plays with forces perhaps left to themselves? Lush gargens, tavern, and lab to experiment with ....  ',['N']='Tinkerer\\'s Retreat',['C']=1.031000,['O']=18892,},[63]={['D']='Home for the Holidays - my cozy place in winter.',['N']='Holiday Snow Globe',['C']=1.022000,['O']=18898,},},['Version']=1773,['TS']=1721523777,['Key']='oh__@tazmyr',}"
