R["oh__@calandriel"]="{['Version']=1773,['na']={[81]={['O']=18991,['N']='Calandriel\\'s Cabin',['D']='When Calandriel feels the need to get away from the hustle and bustle of Alinor, she heads to her cabin. This home is inspired by real-life cabin culture in northern Minnesota. It features an outdoor performance pavillion, a bar overlooking the waterfall, and a custom-built sauna. A full crafting area completes this Nordic-inspired vacation spot.',['C']=1.051000,},[95]={['O']=19621,['N']='Clothier\\'s Studio',['D']='A simple clothier\\'s studio, replete with everything one would need to design and craft garments. ',['C']=1.051000,},[78]={['O']=19028,['N']='Vampiric Elegance',['D']='When not adventuring, this is where Lestat the vampire Dunmer comes to hang his very fashionable hat. Though he is a vampire, he is a mer of refined taste and prefers to live in a home of comfort and style. He enjoys browsing the markets for new furnishings, but tasks his Altmer friend with doing the decorating. \\n\\nThis house uses mainly Vampiric and Alinorean furnishings to create a cozy yet elegant atmosphere.',['C']=1.048000,},[63]={['O']=18991,['N']='Holiday House',['D']='This house is vaguely inspired by the house in Home Alone. Did you ever notice that all the decor in that house is a subtle red and green? That\\'s kind of what I\\'m going for. ',['C']=1.022000,},[70]={['O']=19455,['N']='Twin Moons Manor',['D']='In the Hall of the Colossus lies the home of a Bosmer raised by Khajiit. This home is a custom build that celebrates the luxurious beauty of Elsweyrian design. ',['C']=1.026000,},[71]={['O']=19344,['N']='Elsweyr Meadow',['D']='After years of designing interiors and dabbling with construction projects, the Lady Calandriel decided she wanted to put her architectural skills to the test and build a castle! Located in the lush jungle of Northern Elsweyr, this multi-story palace is full of surprises with every twist and turn, and features an eclectic assortment of furnishings from across Tamriel and beyond. Be sure to keep an eye out for the hidden wine cellar as you explore the sprawling grounds!\\r\\n',['C']=1.017000,},[88]={['C']=1.030000,['D']='Welcome to the Leyawiin Museum! Our current main exhibition is \"ALMSIVI: Secrets of the Tribunal.\" In the first gallery up the stairs is a contextual exhibit dedicated to the Dunmer, their culture, history, and the Great Houses. Above that are two smaller galleries, one with a focus on the Khajiiti culture, and another closed for installation. And in the second building, you\\'ll find the main exhibition. Enjoy your visit and please don\\'t touch the artefacts. ',['N']='Leyawiin Museum',['O']=19803,},[44]={['O']=19379,['N']='Uncle Lassel\\'s Place',['D']='This is the home of Lassel Telvanni, the kindly uncle of a young vampire named Lestat. An eccentric and benevolent necromancer, Lassel lives a bachelor lifestyle in northern Vvardenfell. This home features a mix of Dunmer styles. Upstairs you will find a cluttered study in which the mage likes to conduct his experiments. ',['C']=1.026000,},[86]={['O']=19143,['N']='Temple of Starlight',['D']='These ruins lay undisturbed for centuries until a recent archaeological expedition, funded by the influential Lady Calandriel. Alinorean scholars determined it had been an Ayleid temple dedicated to the stars and named it the Temple of Starlight. The ruins have since been renovated to include a modern kitchen, bedrooms, bathrooms, and a library to accommodate visiting historians and academics who wish to learn about the Ayleids and their fascination with the stars.',['C']=1.026000,},[59]={['O']=19118,['N']='Alinor House',['D']='Though her main home is located on Artaeum, Calandriel spends a LOT of time in Alinor on business. When in the capitol, she stays at her townhome, located in the heart of the city. \\n\\nAfter a long day of fulfilling writs, haggling with traders, and solving the problems of many an NPC, Calandriel seeks respite in her townhouse\\'s outdoor promenade. She recently built a personal garden-themed night club, where some of her favorite bards can stop in to play private shows. \\n\\nThis is a work in progress',['C']=1.051000,},[60]={['O']=19425,['N']='Pleasure Barge',['D']='The Lady Calandriel was gifted a retired naval ship from Queen Ayrenn, which she decided to convert into a pleasure barge. She employs the services of a mysterious seafarer, Aurelio Direnni, to maintain and captain the ship when called upon. Bedecked in string lights, banners, and wisteria, the ship has everything a noble Alinorean could hope for on a luxurious outing into the Sea of Pearls.',['C']=1.015000,},[49]={['O']=18991,['N']='Herbalist\\'s Hut',['D']='This rustic cottage features all the accoutrements that a potion-maker could need. Flowers, herbs, and fungi sprawl all over the yard. Inside you\\'ll find a cozy crafting and cooking area, as well as a bath and sleeping quarters. ',['C']=1.021000,},[62]={['O']=19118,['N']='House Aurealin',['D']='This is the main home of Calandriel, a noble Altmer lady, and an appreciator of all things luxurious and leisurely. \\n\\nThis gorgeous villa boasts a private winery, an art studio, a crafting area, and a vast art collection. Flowering trees and plants abound both inside and out. Beauty and splendor are in abundance at this idyllic manor. ',['C']=1.051000,},[79]={['O']=19379,['N']='Goth Prom',['D']='Welcome to Goth Prom! Enjoy food, drink, music, and merriment, but don\\'t let anyone know how much fun you\\'re having... Because that wouldn\\'t be very Goth! This home is being designed for a ballroom-themed contest, the Molag Ball, and is loosely inspired by Wednesday Addams, a little bit of Harry Potter, and a lot of Blackreach. Glowing mushrooms and crystals create a haunting ambience in which to contemplate your existence or dance to Depeche Mode.',['C']=1.048000,},},['Key']='oh__@calandriel',['TS']=1710990190,}"
