R["fx__na__@beesweet2u__94"]="{['Version']=1773,['TS']=1709878412,['Effects']={[1]={['Roll']=0,['Y']=51589,['Alpha']=1,['Pitch']=0,['SizeZ']=50,['X']=90650.507183,['MetaData']={['title']='INTRODUCTION',['message']='Welcome to a  temple  honoring the Divine known as Khenarthi by the Khajiit, as Kynareth by the Imperial Pantheon, as Kyne by the Nord, and as Tava by the Redguard. Also featuring the Daedric Prince of Dusk and Dawn, Azurah, and the Divine, Arkay.\\t\\n\\nThe Eight Divines as an official religion of the Imperial Pantheon was instituted by Alessia after her leading the slave revolt against the Ayleids. \\n\\nThis is the first of three books. The second is \"Regarding Azura\" and the third is \"Regarding Khenarthi\".\\n\\nPlease enjoy your stay.',},['EffectType']=8501,['Contrast']=2.160000,['Groups']=0,['SizeY']=50,['SizeX']=46.456456,['Z']=93327.833418,['Yaw']=0.858702,['Color']=102439,['Id']=1032,},[2]={['Roll']=0,['Y']=50644,['Alpha']=1,['Pitch']=0,['SizeZ']=70,['X']=85841.762283,['MetaData']={['title']='REGARDING AZURA',['message']='The first statue is Azura. In Elsweyr, Azurah is considered the Mother of all Khajiit. They believe she oversees the Gates of the Crossing behind the Lunar Lattice, a twilight realm between death and the afterlife.\\n\\n\\n\\nAzura is a Daedric Prince whose sphere is dawn and dusk (the magic in-between realms of twilight) as well as mystery and magic, fate and prophecy, and vanity and egotism. Azura is one of the few Daedra who maintains the appearance of being \"good\" by mortal standards, and reportedly feels more concern for the well-being of her mortal subjects than other Daedric Princes. It is said she wants their love above all else, and for her worshippers to love themselves; it pains her when they do not. \\n\\n\\n\\nIn Khajiiti creation myths, Azurah is credited with introducing moon sugar to Khajiit. Azurah carries the burdens of the Khajiit\\'s ancestors; her spheres are Magic, Beauty, and Prophecy, and she is the \"keeper of all gates and keys, all rims and thresholds\". The goddess is credited with making the Khajiit out of the \"forest people\" (some of whom became the Bosmer) living on Nirn and binding them to the Lunar Lattice, (or Ja-Kha\\'jay). It is said that Azurah knows the names of all the Khajiit that will ever live, and knowing her is the first step on their Path. Azurah\\'s is the \"twilight path\" to love and redemption.',},['EffectType']=8501,['Contrast']=1,['Groups']=0,['SizeY']=70,['SizeX']=66.456456,['Z']=87209.248855,['Yaw']=1.120501,['Color']=349598,['Id']=1033,},[3]={['Roll']=0,['Y']=51800,['Alpha']=1,['Pitch']=5.672320,['SizeZ']=50,['X']=71127.450742,['MetaData']={['title']='REGARDING KHENARTHI',['message']='Khenarthi is the strongest of the Sky spirits and is the deity of the heavens, the winds, the elements, and the unseen spirits of the air. Patron of sailors and travelers, they invoke her for auspicious stars at birth and for good fortune in daily life. When the aedra branched off from the daedra to create Nirn, she gave up most of her power to create human-kind. Due to her sacrifice, she is one of the most worshiped Divines.\\n\\nAs Azurah\\'s messenger, Khenarthi ferries the dead Khajiiti souls to her for judgment as shown by the tapestries at the entrance. Azurah tends the lanterns lit by Khenarthi in the eyes of Jone and Jode, their stillborn brothers, when they burn low.\\n\\nWhen True Cats die, their souls are lifted by Khenarthi and flown to the Sands Behind the Stars, to play and prey until the Next Pounce which is when Khenarthi will summon the united spirits of the Khajiiti people to defend creation. Namiira is the antithesis to Khenarthi, who drags the victims of the Bent Dance into the Dark Behind the World, where they become part of her dark litter. They become dro-m\\'Athra.\\n\\nThe statue located upstairs in the temple is of the Divine, Arkay, the God of the Cycle of Birth and Death. Arkay is important in that he is the great spirit who brings every man and woman, human, elf, khajiit, and argonian into this world, and when the time is true, ends their circle.\\n\\nLore books prominently displayed upstairs feature stories of Khenarthi and her various iterations. The painted rocks are done by Black Heights, S. Elsweyr Khajiit who paint their mark in preparation of meeting Khenarthi to travel to the Sands Behind the Stars.\\n\\nPlease visit the meditation garden situated at the back of the temple to conclude your visit. Thank you.',},['EffectType']=8503,['Contrast']=1,['Groups']=0,['SizeY']=50,['SizeX']=46.456456,['Z']=70797.986909,['Yaw']=0.858702,['Color']=994443,['Id']=1034,},},}"
