R["oh__@aryna13"]="{['TS']=1706735049,['Version']=1773,['eu']={[32]={['D']='Born a mermaid in the deep waters of Tamriel, Syrenis was destined from the beginning to avenge her family. She gains her power through hatred and a desire for vengeance, especially on those who have killed her entire family. At the height of her rage, she rose as Syrenis, the Daedric Princess of Dark Waters, Retribution and Rage.\\n\\nThe only reminder of her is this forgotten grotto.',['N']='Specus Adorationis',['C']=1.012000,['O']=19753,},[34]={['D']='Visit the home of a more or less mad scientist! He recently put the sheltered area in front of his house behind glass and brick walls. He did not think about biodiversity. So what happens when the animals in it die? Will he prepare them like the others? Take a look at his house and find out!',['N']='Zwilingsbogen',['C']=1.047000,['O']=19417,},[27]={['D']='Haeream Aquam - that stands for constant water, just as the house by the waterfall has existed forever and will exist forever.',['N']='Haeream Aquam',['C']=1.031000,['O']=19602,},},['Key']='oh__@aryna13',}"
