R["fx__na__@thenytcrawlr__81"]="{['TS']=1706412778,['Version']=1773,['Effects']={[1]={['Groups']=0,['Color']=102440,['SizeX']=42.456456,['Roll']=0,['Pitch']=5.686283,['MetaData']={['message']='Over many a quaint and curious volume of forgotten lore,\\nWhile I nodded, nearly napping, suddenly there came a tapping,\\nAs of some one gently rapping, rapping at my chamber door.\\n\\n\" \\'Tis some visitor,\" I muttered, \"tapping at my chamber door,\\nOnly this and nothing more.\"\\n\\nAh, distinctly I remember it was in the bleak December;\\nAnd each separate dying ember wrought its ghost upon the floor.\\n\\nEagerly I wished the morrow;  vainly I had sought to borrow\\nFrom my books surcease of sorrow, sorrow for the lost Lenore.\\nFor the rare and radiant maiden whom the angels name Lenore;\\nNameless here for evermore.\\n\\nAnd the silken, sad, uncertain rustling of each purple curtain\\nThrilled me, filled me with fantastic terrors never felt before;\\nSo that now, to still the beating of my heart, I stood repeating\\n\" \\'Tis some visitor entreating entrance at my chamber door,\\nSome late visitor entreating entrance at my chamber door;\\nThis it is and nothing more.\"\\n\\nPresently my soul grew stronger; hesitating then no longer,\\n\"Sir,\" said I, \"or Madam, truly your forgiveness I implore;\\nBut the fact is I was napping, and so gently you came rapping,\\nAnd so faintly you came tapping, tapping at my chamber door,\\nThat I scarce was sure I heard you\", here I opened wide the door;\\n\\nDarkness there and nothing more.\\n\\nThen this ebony bird beguiling my sad fancy into smiling,\\nBy the grave and stern decorum of the countenance it wore,\\n\"Though thy crest be shorn and shaven, thou,\" I said, \"art sure no craven,\\nGhastly grim and ancient Raven wandering from the Nightly shore,\\n\\nTell me what thy lordly name is on the Night\\'s Plutonian shore!\"\\n\\nQuoth the Raven  \"Nevermore\"',['title']='The Raven',},['Yaw']=0.858702,['Y']=20984,['Contrast']=1,['Alpha']=1,['SizeZ']=56,['EffectType']=8501,['X']=161010.646661,['Id']=1010,['Z']=154412.713043,['SizeY']=56,},},}"
