R["oh__@mythgard1967"]="{['Key']='oh__@mythgard1967',['na']={[16]={['N']='Romantic Bower',['O']=19382,['D']='Valentine themed getaway for housing contest, 2023!',['C']=1.002000,},[49]={['N']='A Warden\\'s Glade',['O']=19175,['D']='',['C']=1.021000,},[83]={['N']='Markarth Manor',['O']=19177,['D']='My first ever home. The place for my adventuring, scrying, morally ambiguous Templar.',['C']=1.011000,},[35]={['N']='Sentinel House',['O']=19484,['D']='Parse House\\n\\nSmallish Home with 4 different test dummies, aetherial well, storage contains, a few assistants and a low amount of decorations.',['C']=1.008000,},[4]={['N']='Cozy Assassin Corner',['O']=19334,['D']='Time is running out for everyone. An assassin knows this better than most.\\n\\nA quiet place to contemplate the passage of time; to learn and study for the chosen trade and  to enjoy the fruits of labor.\\n\\nEven an assassin needs a cozy comfortable study to retire to!',['C']=1.025000,},[21]={['N']='A Wizard\\'s Workshop',['O']=19175,['D']='',['C']=1.020000,},[30]={['N']='A Green Retreat',['O']=19175,['D']='',['C']=1.021000,},[29]={['N']='Windhelm House',['O']=19270,['D']='Christmas cottage entry for Contest 2022!',['C']=1.022000,},[72]={['N']='Necromancer Lair',['O']=19245,['D']='Contest Entry for Halloween Holiday 2022.\\n\\nMostly finished. I think. I don?\\'t really do horror. But this was fun to try out!',['C']=1.023000,},[41]={['N']='Wizard Fishing Camp',['O']=19211,['D']='',['C']=1.031000,},[61]={['N']='Mushroom Cave Haven',['O']=19214,['D']='My own tiny corner of Blackreach; with a homebase fit for an adventuring scholar.',['C']=1.020000,},[14]={['N']='Longhaven House',['O']=19641,['D']='Housing entry for TGC Harvest/Spooky contest. Went for Harvest theme since I am not super spooky.',['C']=1.022000,},[56]={['N']='Aetherian Sanctuary',['O']=19683,['D']='Inspired by Aetherian Archive!\\n\\nMy main home.\\nAmenities include: All Mundus Stones, Aetherian Well, Banker, Merchant, Ragpicker, Armorer, base cr