R["oh__@soldieredout"]="{['Key']='oh__@soldieredout',['TS']=1702962574,['Version']=1773,['na']={[80]={['D']='The stronghold of Fort Valestrider;\\nThe realm of Crosswych, Duchy of Camlorn;\\nLet it be known that within the realm of Crosswych, nestled within the Duchy of Camlorn, lies the stronghold of Fort Valestrider; situated further within the realm of the Daggerfall Covenant. This fortress stands as a bastion under the governance of Crosswych and the Duchy of Camlorn, overlooking the borderlands and reinforcing its significance within the region, while steadfastly guarding the borderlands of the realm.',['C']=1.017000,['N']='Fort Valestrider',['O']=19701,},[30]={['D']='\\r\\nIn the southeast of Skyrim, Fort Dawnguard once contained a Jarl\\'s vampire son, guarded by the Dawnguard mercenaries. Their duty expanded to hunting vampires, but a tragic necessity led to their disbandment and the fort\\'s abandonment. Whispers now speak of their return, ready to resume their hunt for creatures of the night...',['C']=1.017000,['N']='Fort Dawnguard',['O']=19710,},},}"
