R["fx__na__@soldieredout__80"]="{['Version']=1773,['Effects']={[1]={['Id']=1004,['X']=120976.507297,['EffectType']=4407,['SizeZ']=20,['MetaData']={['message']='Notices\\n',},['Pitch']=6.195919,['SizeY']=20,['Roll']=0,['Contrast']=1.250000,['Color']=284348,['SizeX']=100,['Alpha']=1,['Y']=27744,['Z']=102967.566837,['Yaw']=5.349434,['Groups']=0,},[2]={['Id']=1006,['X']=122020.956705,['EffectType']=8503,['SizeZ']=42,['MetaData']={['message']='Gather, seekers of wisdom, for the tale of Ark\\'ay unveils profound truths echoing through time�a narrative of unyielding pursuit and the sacrifices it demands.\\n\\n\\n\\nArk\\'ay, a humble shopkeeper with an insatiable thirst for knowledge, stumbled upon a cryptic tome said to harbor life\\'s secrets. Enthralled by its mysteries, he devoted himself entirely to deciphering its enigmatic passages, oblivious to the world\\'s unfolding calamity.\\n\\n\\n\\nAs a devastating plague swept his town, Ark\\'ay, consumed by his quest, remained indifferent to the looming peril. His singular focus estranged him from all else�his business crumbled, friendships faded, and even his kin distanced themselves.\\n\\n\\n\\nAmidst his dire illness, Ark\\'ay beseeched Mara, the mother-goddess, for time to unravel the tome\\'s revelations. Mara, in her wisdom, presented a choice: embrace imminent death or ascend as the guardian of life and death\\'s balance.\\n\\n\\n\\nContemplating mortality\\'s weight against eternal stewardship, Ark\\'ay\\'s desire to share his insights swayed his decision. Thus, he accepted divinity, becoming Ark\\'ay, the eternal God of Birth and Death.\\n\\n\\n\\nAs this deity, Ark\\'ay shouldered the sacred duty of preserving life\\'s equilibrium. The burden transcended time, forever questioning the correctness of his choices.\\n\\n\\n\\nReflect on Ark\\'ay\\'s journey, urging us to temper our quest for wisdom with awareness of life\\'s harmony. May we seek enlightenment without forsaking the delicate balance that sustains our existence.',['title']='Sermon: Ark\\'ay, the God of Birth and Death',},['Pitch']=1.570971,['SizeY']=42,['Roll']=0,['Contrast']=1,['Color']=102439,['SizeX']=32.456456,['Alpha']=1,['Y']=27572,['Z']=105336.708343,['Yaw']=3.380703,['Groups']=0,},[3]={['Id']=1007,['X']=117801.162632,['EffectType']=8501,['SizeZ']=30,['MetaData']={['message']='Fort Valestrider Shipping Log\\n\\n\\n\\nDate: 9th Evening Star, 2E 584\\n\\n\\n\\n---\\n\\n\\n\\nContainer 1: Barrel\\n\\n\\n\\nProvisions Crate\\n\\nRations - Qty: 20 days\\' worth\\n\\nFresh Produce - Qty: Various\\n\\nWater Barrels - Qty: 5\\n\\nMead Barrels - Qty: 3\\n\\nSalted Meat - Qty: 15 units\\n\\n\\n\\n---\\n\\n\\n\\nContainer 3: Larger Shipping Crate #1\\n\\n\\n\\nFortification Supplies\\n\\nWooden Planks - Qty: 50\\n\\nIron Nails - Qty: 100\\n\\nCanvas Tarps - Qty: 10\\n\\nReinforcement Beams - Qty: 20\\n\\n\\n\\nMedical Supplies\\n\\nHealing Potions - Qty: 30\\n\\nBandages - Qty: 50\\n\\nSalves and Ointments - Qty: Assorted\\n\\n\\n\\n---\\n\\n\\n\\nContainer 4: Larger Shipping Crate #2\\n\\n\\n\\nWeaponry and Armaments\\n\\nSteel Swords - Qty: 15\\n\\nIron Shields - Qty: 10\\n\\nCrossbows - Qty: 5\\n\\nQuivers of Arrows - Qty: 500\\n\\n\\n\\nCommunication Devices\\n\\nScrolls of Sending - Qty: 5\\n\\nEnchanted Crystals for Long-Distance Communication - Qty: 3\\n\\n\\n\\n---\\n\\n\\n\\nAdditional Notes:\\n\\nThe Daggerfall Covenant has established a tent command site for strategic planning and coordination. Please exercise caution when navigating around the tactical command area. Ensure that all shipments are logged and reported to the designated quartermaster. Any issues or discrepancies should be reported immediately to the commanding officer.\\n\\n\\n\\n---\\n\\n\\n\\nPrepared by: Gaspard Durand\\n\\nDaggerfall Covenant Logistics Division',['title']='Fort Valestrider Shipping Log',},['Pitch']=1.542871,['SizeY']=30,['Roll']=0,['Contrast']=1,['Color']=102439,['SizeX']=26.456456,['Alpha']=1,['Y']=27572,['Z']=101969.261579,['Yaw']=2.888520,['Groups']=0,},[4]={['Id']=1008,['X']=119719.834388,['EffectType']=191,['SizeZ']=253,['MetaData']={},['Pitch']=0,['SizeY']=253,['Roll']=0,['Contrast']=1,['Color']=999998,['SizeX']=455,['Alpha']=1,['Y']=27727,['Z']=101129.515564,['Yaw']=2.261947,['Groups']=0,},[5]={['Id']=1010,['X']=117646.508058,['EffectType']=8503,['SizeZ']=41,['MetaData']={['message']='Welcome to Glenumbra, Fighter!\\n\\n\\n\\nThe Daggerfall Covenant: Glenumbra stands as a bastion of the Daggerfall Covenant, a vital region in the Alliance War. The Covenant\\'s interests in this rugged land are extensive.\\n\\n\\n\\nQuests & Challenges: Expect a multitude of tasks that involve combating supernatural threats, from werewolves prowling the forests to Daedric cults and Reachmen plaguing the region. Aid the locals, delve into mysteries, and face off against a diverse array of adversaries.\\n\\n\\n\\nHub of Activity: Daggerfall serves as the Covenant\\'s stronghold in Glenumbra, providing quests, services, and connections for Fighters Guild members. Camlorn\\'s ancient ruins and the perilous Mines of Khuras are key locations teeming with dangers and opportunities.\\n\\n\\n\\nDiverse Adversaries: Sharpen your combat skills to combat a variety of foes�bandits, wild beasts, necromancers, and Daedric forces�all threatening the peace of Glenumbra.\\n\\n\\n\\nGuild Support: Leverage the Fighters Guild halls for missions, guidance, and training. The Guild\\'s influence and resources are crucial in your mission to maintain order and security.\\n\\n\\n\\nIn this era of unrest and conflict, Glenumbra relies on your prowess as a member of the Fighters Guild. Stand firm, take on the challenges, and ensure the Covenant\\'s strength in this perilous landscape.',['title']='Fighter\\'s Guild Guide - Glenumbra',},['Pitch']=1.602212,['SizeY']=41,['Roll']=0,['Contrast']=1,['Color']=222173,['SizeX']=30.456456,['Alpha']=1,['Y']=27973,['Z']=101995.670932,['Yaw']=2.937389,['Groups']=0,},[6]={['Id']=1011,['X