R["fx__eu__@mondennebel__47"]="{['Effects']={[1]={['EffectType']=910,['Yaw']=4.375540,['Z']=90462.968955,['SizeY']=2340,['Alpha']=1,['Roll']=0,['Groups']=0,['Contrast']=1.880000,['Color']=999988,['Pitch']=1.570971,['SizeZ']=2340,['Id']=1007,['Y']=36997,['SizeX']=4620,['X']=83380.459099,},[2]={['EffectType']=8503,['Yaw']=2.787291,['Z']=83847.863707,['X']=71946.483204,['SizeY']=50,['Contrast']=0.860000,['Roll']=0,['Groups']=0,['Pitch']=5.148721,['Color']=264999,['SizeZ']=50,['MetaData']={['message']='\\nMit vorsichtigem Schritt und pochendem Herzen betrat ich die nächste Ebene, die Ebene der Erinnerungen. Ein gedämpftes Licht erfüllte den Raum, als ob die Zeit hier anders fließen würde. \\n\\nKaum hatte ich meinen Fuß auf die letzte Stufe der Treppe gesetzt, verfiel ich einen traumähnlichen Zustand. Bilder flackerten in mir auf auf. Ich opferte mein Blut der Acht, schmiedete mit feuriger Entschlossenheit das legendäre Schwert der Ansei neu.  \\n\\n\\n\\nWieder bei Sinnen, spürte ich eine unheimliche Präsenz. Ein Schatten der Vergangenheit oder einer anderen Dimension schien mir gefährlich nahe gekommen zu sein. Ein Kalter Schauer lief mir über den Rücken. Rasch suchte ich mir ein Versteck. \\n\\nEinen Moment der Ruhe suchend, setzte ich mich hin. Ich schloss die Augen, atmete tief ein und aus. Mein Puls beruhigte sich, und ein Gefühl der Gelassenheit durchströmte mich. \\n\\n\\n\\nDann, ohne Vorwarnung, durchbrach ein kratzendes, fast unheimliches Geräusch die betörende Stille. Vorsichtig schaute ich aus dem Versteck und sah, wie sich eine weitere Tür öffnet. Ein schimmerndes Licht erhellte den Rahmen. Was würde mich wohl hinter dieser Tür erwarten? Ein neues Kapitel meiner Reise? Ein weiteres Rätsel, das es zu lösen galt? Schnell schlich ich die Treppe hinauf.\\n\\n',['title']='Erinnerungen der Welt',},['Id']=1008,['Y']=36893,['SizeX']=46.456456,['Alpha']=1,},[3]={['EffectType']=8503,['Yaw']=4.293510,['Z']=82845.765533,['X']=73500.935229,['SizeY']=90,['Contrast']=4,['Roll']=0,['Groups']=0,['Pitch']=4.712564,['Color']=102439,['SizeZ']=90,['MetaData']={['message']='Der Meister hatte die Gemäuer schon seit Stunden verlassen, in der Hoffnung, dass die Dunkelheit ihm Frieden bringen würde. Doch für mich, Azul al Hadere, war die Nacht die perfekte Kulisse für eine tiefe, fast obsessive Durchforstung alter Legenden und verlorener Magie. Ich wandelte durch den verlassenen Studiensaal, dessen Kerzenschein die Ecken der vergilbten Manuskripte nur spärlich erhellte. Jeder Foliant schien in seiner eigenen Aura aus Mystik und Geheimnissen zu baden, als ich sie sorgfältig durchblätterte.\\n\\n\\n\\nEndlich stieß ich auf ein besonderes Skriptum, ein Werk über die Elemente von Eis und Feuer, zwei so gegensätzliche Kräfte, und doch im Kern miteinander verwoben. Ich pustete den Jahrhunderte alten Staub vom Leder des Einbands und legte das Buch ehrfurchtsvoll auf das hölzerne Pult, das nahe des zwielichtigen Portals stand. Ein Portal, das Gerüchten zufolge in andere Welten führte. Mit einem Gefühl von Erhabenheit und einer gewissen Ungeduld las ich die magische Formel, die in altmodischer Schrift auf einer der ersten Seiten verzeichnet war...',['title']='Anfang der Studien',},['Id']=1011,['Y']=34672,['SizeX']=66.456456,['Alpha']=1,},[4]={['EffectType']=8503,['Yaw']=1.123992,['Z']=81996.471509,['X']=70888.442971,['SizeY']=110,['Contrast']=1,['Roll']=0,['Groups']=0,['Pitch']=5.410521,['Color']=102439,['SizeZ']=110,['MetaData']={['message']='Beachten Sie, dass der unsachgemäße Gebrauch dieser Formeln zu unvorhergesehenen und oft gefährlichen Konsequenzen führen kann. Die Meisterschaft dieser Formeln setzt ein tiefes Verständnis der zugrunde liegenden magischen Prinzipien voraus.\\n\\nMöge diese Formelsammlung dem Suchenden die Türen zu ungeahnten Möglichkeiten öffnen. \\n\\n\\n\\nFormel der Lichtbündelung: \"Lumos\"\\n\\nAnwendung: Erzeugt ein Licht am Zauberstab oder an der gewählten Lichtquelle.\\n\\n\\n\\nFormel der Schwerkraftumkehr: \"Leviosa\"\\n\\nAnwendung: Lässt Gegenstände schweben oder hebt sie an.\\n\\n\\n\\nFormel der Illusion: \"Invisibilia\"\\n\\nAnwendung: Verleiht dem Anwender oder einem Gegenstand zeitweise Unsichtbarkeit.\\n\\n\\n\\nFormel des Schweigens: \"Silencio\"\\n\\nAnwendung: Bringt die Zielperson oder den Zielgegenstand zum Schweigen.\\n\\n\\n\\nFormel der Gedankenlese: \"Legilimens\"\\n\\nAnwendung: Ermöglicht es dem Zaubernden, die Gedanken einer anderen Person zu lesen.\\n\\n\\n\\nFormel des Verschwindens: \"Evanesco\"\\n\\nAnwendung: Lässt Gegenstände verschwinden oder löst sie auf.\\n\\n\\n\\nFormel des Öffnens: \"Alohomora\"\\n\\nAnwendung: Öffnet Türen und Verschlüsse, auch magisch versiegelte.\\n\\n',['title']='Skriptum von Eis und Feuer',},['Id']=1012,['Y']=34695,['SizeX']=86.456456,['Alpha']=1,},[5]={['EffectType']=8502,['Yaw']=6.155776,['Z']=83079.541999,['X']=71371.230484,['SizeY']=110,['Contrast']=1.640000,['Roll']=0,['Groups']=0,['Pitch']=1.658063,['Color']=105902,['SizeZ']=110,['MetaData']={['message']='Ich betrat die letzte Ebene, Sinnbild für die zyklische Natur der Jahreszeiten und des Lebens. \\n\\nStaunend nahm ich die Flora wahr. \\nSoviele wunderbare Geschöpfe, ein Baum Yffres, Kürbisse, sogar eine Krabbelblüte war unter den Unikaten.\\n\\nEin Kapitel meiner Lehren neigte sich langsam dem Ende zu. Ich fragte mich: Welches neue Kapitel ich nun aufgeschlagen würde. \\n\\nLangsam verstand ich die Zusammenhänge der Magie, der Zeit und der Welt. \\n\\n\\nErschöpfung durchdrang jede Faser meines Körpers, doch ich war so fasziniert, dass ich es noch ignorieren konnte.\\n\\n Die Gerüche und Farben, so intensiv ....\\n\\nAll dies nahm mein Mentor für selbstverständlich. Er lebte schon lange in diesem Turm.\\n\\nAber für mich stand von diesem Zeitpunkt eines fest: \\nIch, Azul al Hadere, werde die Welt bereisen und noch viele weitere Rätsel lösen und Geheimnisse durchdringen.\\n\\nSchlagartig nahm ich ein lähmendes Gefühlt wahr. War es Gift? \\n\\nNein, nur Müdigkeit, die wir Oreichalkos an meinen Gliedern zog. Ich suchte meinen Stuhl und lies mich hineinfallen. Dabei entwich mir ein Heureka ... das nächste was mir passierte war so unglaublich, das ich schnell ein Bild in meinem Kopf davon machen musste und sollte Euch ähnliches geschehen, kann ich Euch auch nur dazu raten.',['title']='Die Ebene der Jahreszeiten',},['Id']=1013,['Y']=38035,['SizeX']=86.456456,['Alpha']=1,},[6]={['EffectType']=8503,['Yaw']=5.585054,['Z']=82392.566801,['X']=73962.331582,['SizeY']=110,['Contrast']=1.250000,['Roll']=0,['Groups']=0,['Pitch']=1.570971,['Color']=990457,['SizeZ']=110,['MetaData']={['message']='Nach Jahren der Studien und des mentalem Trainings fand ich mich, Azul al Hadere, auf der Ebene des Geistes wieder, einem Raum, der mehr einer inneren Landschaft als einer physischen Realität glich.\\n\\n\\n\\nMit Geduld und Disziplin, die nicht von ungefähr kamen, sondern das Resultat jahrelanger Übung und meditativer Praktiken waren, stellte ich mich der Herausforderung, die Gedankenbarriere zu durchbrechen. Es war ein Prozess, der gleichzeitig schmerzhaft und erlösend war, als wären Ketten, die meine Gedanken und meine Seele jahrelang gefesselt hatten, endlich gesprengt worden. \\n\\n\\n\\nMit dieser neu gewonnenen Klarheit, die sich anfühlte, als würde ich aus einem tiefen Schlaf erwachen, richtete ich meine nun immens gesteigerte Willenskraft auf das Herz des schimmernden Kristalls. Ich konnte die Energie des Kristalls spüren, wie sie pulsierte und mit meiner eigenen Resonanz in Einklang kam. Es war, als würden zwei Seelen miteinander singen, in einer Harmonie, die nur in den Tiefen des Geistes möglich war.\\n\\n\\n\\n Anschließend verfiel ich in eine tiefe, meditative Pose. Beim Öffnen meiner Augen manifestierte sich vor mir eine rätselhafte Fläche, auf der sich geheimnisvolle Symbole und Runen bewegten. Es war ein Portal zur inneren Welt, ein Fenster, das mehr reflektierte als nur das Sichtbare. Als ich näher trat, erhaschte ich verschwommene Eindrücke meiner Ängste, unausgesprochenen Wünsche und tief verborgenen Absichten. Mit jeder aufkeimenden Erkenntnis schien die Fläche klarer zu werden, als würde sie die Nebel meiner Existenz lichten. Ich spürte, wie sich mysteriöse innere Barrieren öffneten und mir Zugang zu den unbekannten Tiefen meiner Seele gewährten. Ich war bereit für die nächste Ebene der Erkenntnis.\\n\\n',['title']='Ebene des Geistes',},['Id']=1014,['Y']=35801,['SizeX']=66.456456,['Alpha']=0.660000,},[7]={['EffectType']=8503,['Yaw']=3.277728,['Z']=86145.822456,['SizeY']=110,['X']=84026.610030,['Contrast']=1,['Roll']=0,['Groups']=0,['Alpha']=1,['Color']=40342,['SizeZ']=110,['MetaData']={['message']='Grüße, unerschrockene Seelen, Sucher des Verborgenen und Wanderer der Ewigkeit,\\n\\n\\n\\nhr habt Ebenen durchquert, Meere überwunden und Berge bezwungen, nur um an diesen mystischen Ort zu gelangen, an dem Wahrheit und Illusion miteinander verschmelzen. Wie ich, Azul al Hadere, einst meine eigenen Fußspuren in den Sand der Zeit gesetzt habe, so lade ich euch ein, meinen Spuren zu folgen und die letzten, unausgesprochenen Wahrheiten zu entdecken.\\n\\n\\n\\nAber lasst euch warnen! Das Tor, das ihr zu durchschreiten gedenkt, schließt sich für immer hinter euch und der Weg zurück wird zu einer Illusion, so flüchtig wie der Morgennebel.\\n\\n\\n\\nIhr steht vor dem Eingang zu einem geheimnisvollen Ort, der Euren Verstand, Eure Intuition und Euren Instinkt testen wird. Nur diejenigen, deren Herzen rein und deren Wille unerschütterlich ist, werden die Geheimnisse entschlüsseln.\\n\\n\\n\\nWagt es, den versteckten Pfad des Drachen zu beschreiten. Taucht ein in die schwindelerregenden Tiefen der unbekannten Weisheit und der verborgenen Erkenntnis. Ihr werdet auf Abgründe stoßen, auf mysteriöse Schwellen und verzauberte Räume, die selbst den mutigsten Helden und klügsten Gelehrten in die Knie zwingen könnten.\\n\\n\\n\\nSeid also gewarnt, seid wachsam, aber vor allem, seid bereit, den Pfad des Drachen zu betreten und euch in die Tiefen zu stürzen, um das Unbekannte zu erforschen?\\n\\n\\n\\nMöge euer Herz mutig und euer Geist klar sein.\\n\\n\\n\\nAufrichtig Euer Azul al Hadere\\n\\n\\n\\nPS: \\n\\nUm Euch den Weg zu erleichtern, habe ich meine Tagebucheinträge zurückgelassen.',['title']='Beginn einer Reise',},['Id']=1015,['Y']=36964,['SizeX']=106.456456,['Pitch']=5.061455,},},['TS']=1696168943,['Version']=1773,}"
