R["fx__@jemimaturner"]="{['Houses']={[1]={['Effects']={[1]={['Y']=34984,['Contrast']=1,['Pitch']=0,['SizeX']=35,['Roll']=0,['Id']=1368,['X']=48917,['Z']=52727,['Yaw']=5.331981,['Groups']=0,['Color']=292800,['Alpha']=0.490000,['SizeZ']=35,['SizeY']=35,['EffectType']=463,},},['Version']='15.9.9',['World']='na',['HouseId']=26,['TS']=1607621629,},[2]={['Effects']={[1]={['Pitch']=5.206317,['Y']=20931,['Contrast']=1,['Id']=1469,['SizeX']=46.456456,['Roll']=5.878269,['X']=26566,['Color']=997535,['Z']=24093,['Yaw']=4.560545,['Groups']=0,['MetaData']={['message']='I have lost my firstborn son, my heir, my precious boy. I have lost my beloved mate, Grunda. Both taken by a terrible monster, a crocodile my clan hunted for years. My Grunda killed it, stabbed it in the brain, but she couldn\\'t save our son. She went to the Ashen Forge knowing she had failed to save him, but at least she is with him now... and forever.\\n\\nIf I had gone with them on that trip to the river, perhaps I could have been the one to kill that monster. But I did nothing to help my family; I was too busy plotting and training for future battles. The only hope I have now is that I will die a noble death one day and join my family at the Ashen Forge.\\n\\nMy mind is twisted with pain and longing and anger that Grunda robbed me of the chance to avenge my son\\'s death. How can I feel that way? My brave mate gave her life for our son... and I envy her and hate her for it! I am a sad, sorry, despicable excuse for a warchief.\\n\\nDrink and sleeping potions call to me at night. By day, I am trying to act as a warchief should for my men, but they are looking at me out of the sides of their eyes. They see my pain, they know my grief; they are worried, but they soldier on. I only pray for the Ashen Forge. This weakness in me cannot continue. I am putting the entire clan at risk by my behaviour, but I cannot see any light. The only light I see is the glow of the Ashen Forge somewhere in my future.',['title']='I Dream of the Ashen Forge',},['Alpha']=1,['SizeZ']=50,['SizeY']=50,['EffectType']=8503,},},['Version']='16.2.1',['World']='na',['HouseId']=29,['TS']=1614970521,},[3]={['Effects']={},['Version']='16.2.1',['World']='na',['HouseId']=19,['TS']=1615080342,},[4]={['Effects']={},['Version']='16.2.1',['World']='na',['HouseId']=6,['TS']=1615156068,},},['Key']='fx__@jemimaturner',['TS']=1669157276,}"
