'Groups']=0,['Contrast']=1.750000,['Pitch']=0,['Yaw']=0,['Roll']=0,},[28]={['Id']=1157,['SizeX']=3400,['X']=81861,['SizeY']=3400,['Color']=272727,['Y']=40505,['Alpha']=0.730000,['SizeZ']=3400,['EffectType']=906,['Z']=94451,['Groups']=0,['Contrast']=1.900000,['Pitch']=0,['Yaw']=1.570796,['Roll']=0,},[29]={['Id']=1159,['SizeX']=1400,['X']=83689,['SizeY']=1400,['Color']=2199,['Y']=42544,['Alpha']=1,['SizeZ']=1400,['EffectType']=544,['Z']=96496,['Groups']=0,['Contrast']=1,['Pitch']=0,['Yaw']=3.141593,['Roll']=0,},[30]={['Id']=1162,['Roll']=0,['Alpha']=1,['X']=82039.455840,['SizeY']=70,['Color']=102439,['Y']=40650,['Z']=92294.602901,['SizeZ']=70,['EffectType']=8502,['Yaw']=2.268928,['Groups']=0,['Contrast']=1,['Pitch']=5.585054,['MetaData']={['message']='Once upon a time, there was a great king admired by all. How brave! How clever! How shining his golden crown! He won every contest, and in victory was always merciful, offering his foes his hand or his sword in consolation.\\n\\nBut one villain could not accept either fate. She took the hand, rose to her feet beside the Paragon, and dealt him a blow aimed to kill.\\n\\n\"My heart/eye/mind!\" he s/c/r/e/a/m/e///d.\\n\\nHis opponent knelt beside him, dripping tears, and took his crown.\\n\\nAnd then it seemed he was alone in his agony. He could not see his subjects. They appeared as straw-stuffed dolls with eyes made of whispers. He feared they would finish him, now that he was broken and no longer their king.\\n\\nHe fled in panic. On the way, he passed the royal surgeon.\\n\\n\"Help me,\" he pleaded.\\n\\n\"Looks like someone needs to be put together again,\" the surgeon observed, turning away.\\n\\nDismissed, the Once-Paragon found his way to the woods, seeking protection there. Within, he felt himself watched. Near-bereft of hope, he cried out to the shadows for aid. \"Help me.\"\\n\\n\"This place is everything that is not you,\" droned The Woods. \"You trepass.\"\\n\\n\"I want to be myself again,\" the Pariah begged.\\n\\nThe Woods emitted a low hum. An image appeared as a reflection in its eyes. It was the Paragon at the moment of her death. A figure stood over her, weeping.\\n\\n\"How will I find myself?\" the Pariah wailed, broken. The shadows in the woods crept closer around her. \"How will I recover my crown when with every moment I am diminished?\" The shadows dared even closer.\\n\\n\"Help me,\" she rasped, reaching her hand toward them. Numbness consumed her as they answered.\\n\\n\"I will be your eyes,\" one said sharply.\\n\\n\"I will be your mind,\" giggled another.\\n\\n\"I will be your heart,\" roared the third.\\n\\n\"I WILL BE YOUR CROWN.\"',['title']='The Tale of the Paragon',},['SizeX']=46.456456,},[31]={['Id']=1175,['SizeX']=4400,['X']=84574.201217,['SizeY']=4600,['Color']=997197,['Y']=48121,['Alpha']=1,['SizeZ']=4600,['EffectType']=3,['Z']=89633.377894,['Groups']=0,['Contrast']=2.060000,['Pitch']=4.712564,['Yaw']=3.752458,['Roll']=0,},},['Version']=1767,}"
