R["fx__na__@ivelbob__6"]="{['Version']=1766,['TS']=1636505264,['Effects']={[1]={['SizeY']=70,['SizeZ']=70,['Yaw']=5.143485,['Id']=1175,['SizeX']=46.456456,['Z']=27168.233518,['Contrast']=1,['Color']=139899,['Pitch']=5.759587,['Alpha']=1,['X']=26577.340059,['Roll']=0,['EffectType']=8503,['Y']=20138,['Groups']=0,['MetaData']={['title']='Khunzar-ri\\'s Lost Tomb & Gift Shop',['message']='Sereyne has a plan to use the power of story and myth for fun and profit! \\n\\nYou would expect the long-lost tomb of Khunzar-ri to be in a remote cave in Elsweyr instead of beside a busy road in Mournhold. But budding entrepreneur Sereyne has convinced the legendary Khajiit spirit to relocate because bustling cities have many more paying customers than distant caves.  \\n\\nAs a roadside attraction, \\'The Lost Tomb of Khunzar-ri\\' is a fabulous moneymaker. Tourists drop in all the time to see Zar\\'s famous sarcophagus and marvel at the carvings depicting many of his legendary exploits: Khunzar-ri chaining and binding the dragons; killing three trolls with a single spear throw; tricking the abbot with an effigy of Jone and Jode. (The carvings have been thoughtfully weathered to give tourists the satisfying appearance of authenticity.) \\n\\nOn the way out, tourists can also pick up an authentic Wrathstone replica (autographed!), a commemorative mug marking the liberation of Anequina, or a Heiruna doll...er, Lunar Champion plushie. \\n\\nKhunzar-ri doesn\\'t mind; he loves the attention and his share of the profits pays for plenty of skooma and dancing alfiqs. ',},},[2]={['SizeY']=90,['SizeZ']=90,['Yaw']=1.274090,['Id']=1176,['SizeX']=46.456456,['Z']=26954.543210,['Contrast']=1,['Color']=102439,['Pitch']=4.974188,['Alpha']=1,['X']=26043.606852,['Roll']=0,['EffectType']=8503,['Y']=20096,['Groups']=0,['MetaData']={['title']='Khunzar-ri\\'s Dirty Magazine Stash',['message']='<You see several centerfolds depicting balls of yarn in compromising positions...>',},},},}"
