R["fx__na__@ivelbob__87"]="{['Version']=1734,['TS']=1624323018,['Effects']={[1]={['EffectType']=8503,['Y']=13641,['Groups']=0,['SizeZ']=50,['Color']=102439,['Id']=1108,['X']=23562,['SizeY']=50,['Z']=21395,['SizeX']=26.456456,['MetaData']={['title']='Coldharbour Contract',['message']='Imposter! I spent years carefully curating my distinctive outfit of green and gold. Only to have this talentless fool steal my look! \\n\\nEvery week, you will find them strutting around Zanil Theran, showing off MY ensemble! I will suffer the sight of this copycat no longer! This crime of fashion deserves the ultimate punishment. \\n\\nI don\\'t care how you do it. Only that you look them straight in the eye as they breathe their last. And tell them \"Moo.\"\\n',},['Pitch']=5.145231,['Alpha']=1,['Yaw']=2.062979,['Roll']=0,['Contrast']=1,},},}"
