R["fx__na__@camomile__33"]="{['Version']=1731,['TS']=1622518463,['Effects']={[1]={['MetaData']={['title']='The Order of the Remains',['message']='Greetings, pilgrim or initiate. We faithful of Arkay, Jephre, and the Lesser Dragon welcome you, and hope that this guide will grant you clarity regarding our presence and purpose in these Viridian wilds.\\n\\nYou may have heard many rumors about the Order. Some of the most extreme: that we foster a breeding ground for the Knahaten flu, that we represent a vile syncretism of Divine and Daedric faiths, that our ever-burning funerary pyres are fed with the corpses of hapless trespassers.\\n\\nThe stories are varied and artful, but let us set the record straight. First, it is true that our community was forged by the Knahaten flu, but contrary to belief, we have only ever sought to protect ourselves and our neighbors from disease. Despite the flu\\'s decline, the quarantine ward of our upper west wing continues to be reserved as a space for safe and respectful housing of the sick, and our means of cremation ensure safe handling of remains.\\n\\nSecond: although followers of Arkay and Jephre have been enduring supporters of our works, we have never been associated with the orthodox Temple of the Divines. Reverence for spirits of the Wyrd, as well as worship of the Old Gods, runs deep within our joint faith. We respect Lesser Dragon in particular, but all peaceful beliefs are welcome here.\\n\\nFinally, the ritual of isolation that every visitor endures upon arrival has been controversial, but is essential to our goals. Uninformed guests and trespassers are subjected to our rules out of necessity, and by temporary imprisonment if required. However, we are not punitive. All are released so long as symptoms of disease do not manifest.\\n\\nQuestions are welcome; otherwise, join us in harmony.\\n\\nThe Abbess\\n\\n[handwritten] Prayers to Clavicus Vile are no longer permitted on Abbey grounds!',},['Roll']=0,['Contrast']=1,['Yaw']=4.188790,['Alpha']=1,['Z']=57836,['X']=47632,['SizeZ']=30,['EffectType']=8502,['Y']=17776,['SizeX']=26.456456,['Id']=1138,['Color']=576299,['Groups']=0,['SizeY']=30,['Pitch']=5.288348,},},}"
